INSERT INTO `tramites` VALUES (2, 16, 48, 'Préstamo a domicilio de acervo bibliográfico', 'Homo Clave', 'El ciudadano puede solicitar acervo bibliográfico en préstamo para su consulta en casa.', ' Se presenta la credencial vigente de la Biblioteca Pública Municipal correspondiente y se registra el o los libros que se desean llevar en préstamo (Hasta 3 libros).', '', 0, '', '5 minutos', '15 minutos', NULL, NULL, '', 'Permanente', '8 días', 'ciudadano', '', '', '', '', 2, '2019-10-03', '2019-10-03 14:00:51', 8, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (3, 7, 18, 'Arrastre de grúa. ', 'Homo Clave', 'Los arrastres son la remoción de vehículos mal estacionados al depósito de vehículos por infracción de tránsito.\r\nArrastres de vehículos del servicio público, tipo taxi, siniestrados en hechos de tránsito\r\n', '•	Asistir a la Dirección de tránsito y Vialidad en el área de infracciones, con la documentación necesaria para la realización del trámite.\r\n•	En el mismo día se concluye el trámite. \r\n', '', 0, '', 'de 15 min a 24 horas ', 'Cuestion de horas. ', NULL, NULL, '•	$676.00 vehículo uso particular.\r\n•	$591.00 vehículo trasporte público, modalidad taxi.\r\n', 'Permanente ', 'Dependiendo de la institución donde vaya a realizar el trámite. ', 'ciudadano/empresa', 'Reglamento de Seguridad Publica, Tránsito y Vialidad Municipal, vigente en el Municipio de Uruapan Michoacán y ley de ingresos que emite la Tesorería Municipal.  ', '', 'Lunes a Viernes de 8:00 a 15:00 horas.', 'Cuando el vehículo que se remite al depósito vehicular es del servicio público, modalidad taxi, el costo es de $591.00 y el servicio es las 24 horas del día.\r\n\r\nLa Dirección de Tránsito y Vialidad Municipal, no cuenta con depósito vehicular propio, por lo que el pago por resguardo y depósito vehicular se realizara directamente con el concesionario en el cual se remite el vehículo.\r\n', 0, '2019-10-03', '2019-10-03 14:00:27', 6, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (4, 4, NULL, 'Sugerencias', 'Homo Clave', 'Atender las sugerencias presentadas por la ciudadanía en aras de mejorar la calidad de los trámites o servicios que presten las oficinas, dependencias y entidades del Ayuntamiento de Uruapan, Michoacán.', 'Trámite en Línea:\r\nIngresar a la página electrónica http://contraloria.uruapan.gob.mx, y emitir la sugerencia de manera anónima o personalizada, indicando (nombre del servidor público (en caso de tenerlo), secretaría, dirección o departamento municipal, narración clara y concisa de la sugerencia y si cuenta con algún medio de prueba adjuntarlo).\r\n\r\nVía Telefónica:\r\nComunicarse vía telefónica al 452 52 40092 Ext. 206, manifestando el motivo de la sugerencia.\r\n\r\nPresencial:\r\nPresentar un escrito libre dirigido a la Contraloría Municipal, o mediante el formato de quejas, denuncias y sugerencias, debiendo indicar (Nombre y Dirección del solicitante, Nombre del Servidor Público (en caso de tenerlo), Secretaría, Dirección o Departamento Municipal, narración clara y concisa de los hechos y si cuenta con algún medio de prueba anexarlo).\r\n\r\nProcedimiento interno:\r\n•	Se remite la sugerencia al área correspondiente para que emita un informe y otorgue respuesta a la sugerencia.\r\n•	 Se notifica al ciudadano el resultado de la atención a la sugerencia presentada.\r\n', '', 0, '', '3 días', '3 días', NULL, NULL, '', 'Permanente', 'Dependerá del análisis de la información proporcionada por el ciudadano, en conjunto con las leyes, reglamentos y normatividad aplicable; el periodo de conservación de la respuesta generada', 'ciudadano/empresa', 'Artículo 59 fracción X de la Ley Orgánica Municipal del Estado de Michoacán de Ocampo.\r\nArticulo 42 Fracciones VIII y IX del  Reglamento Interno de la Administración Municipal de Uruapan, Michoacán.\r\n', '', 'En línea, horario de atención 24 horas.\r\nVía telefónica, horario de atención 8:00 a 16:00 hrs.\r\nPresencial, horario de atención 8:00 a 16:00 hrs.', '', 2, '2019-10-03', '2019-10-03 14:00:44', 4, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (5, 6, NULL, 'LIBERACIÓN DE SERVICIO SOCIAL', 'Homo Clave', '•	Se realiza la aceptación de estudiantes en los niveles de preparatoria y licenciatura para realizar su servicio social basado en las modalidades de cada escuela', '•	Se atiende al estudiante y se valora si hay espacio para aceptarlo\r\n•	Se agenda cita para el estudiante en el área asignada\r\n•	Se reciben los documentos \r\n•	Se entrega una carta de aceptación \r\n•	Se realizan reportes mensuales durante su periodo de servicio y se lleva el registro\r\n•	Se entrega la carta de liberación \r\n', '', 0, '', '24 horas', '48 horas  ', NULL, NULL, '', 'Permanente', '15 días', 'ciudadano', '', '', 'Lunes a Viernes de 08:00 a 15:00 hrs.  ', '', 2, '2019-10-03', '2019-10-03 14:00:52', 14, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (6, 7, 19, 'Atención a víctimas.', 'Homo Clave', 'Apoyo y orientación a víctimas de violencia, por lo regular son por violencia física y emocional. ', '•	El elemento de la policía traslada la victima a las instalaciones de la Secretaria de Seguridad Publica. \r\n•	Del área de conmutador se localiza a la persona en guardia de la Jefatura de Prevención Social y Participación ciudadana. \r\n•	Se levanta el formato de ficha única donde viene datos personales.\r\n•	Se le ofrece contención y orientación de que hacer dependiente del caso de la víctima. \r\n•	Se canaliza a las diferentes áreas según el caso de las víctimas. \r\n', '', 0, '', '15 minutos', '24 horas ', NULL, NULL, '', 'Permanente', 'No hay documento ', 'ciudadano', 'NO APLICA', '', '24 horas al día, los 7 días de la semana.', ' No es necesario que la víctima presente algún tipo de documentación para realizar el apoyo. ', 2, '2019-10-03', '2019-10-03 14:00:27', 6, NULL, NULL, NULL, 1);
