INSERT INTO `tramites` VALUES (12, 10, 24, 'Apoyo para realizar Proyecto y Presupuesto ', 'Homo Clave', 'Apoyo con la realización de proyectos de infraestructura: como son la construcción, ampliación o modificación de viene inmuebles destinados directamente a la presentación de servicios de comunicaciones, transportes, medio ambiente, turístico, educación y salud, que sean de jurisdicción municipal. ', 'Se recibe la solicitud y requisitos del ciudadano\r\nSe realiza el proyecto\r\nSe entrega solicitud al Topógrafo para que realice la visita a la ubicación \r\nSe realiza visita física al domicilio en mención\r\nDespués del tiempo estipulado se termina el proyecto\r\n', '', 0, '', '15 días', '30 días ', NULL, 0, '', 'permanente', '6 meses', 'ciudadano/empresa', 'Reglamento de Construcción', '', '8:00 A 16:00 HORAS', '', 2, '2019-10-03', '2019-10-03 14:00:36', 2, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (14, 15, 44, 'Programa de consultoría integral de salud ', 'Homo Clave', 'En el programa de consultoría integral de salud se ofrecen los servicios médico familiar y de enfermería, así como la canalización a pacientes de bajos recursos con especialistas, laboratorios de análisis clínicos e imagenología, mediante convenios con instituciones públicas y privadas a bajo costo. ', 'Se atiende al paciente al momento de su llegada ', '', 0, '', '1 hora', '2 horas', NULL, NULL, '', 'permanente', '12 meses', 'ciudadano', '', '', '08:00 a 15:00 horas', '', 2, '2019-10-03', '2019-10-03 14:00:40', 16, NULL, NULL, NULL, 1);
