INSERT INTO `tramites` VALUES (19, 2, NULL, 'CERTIFICADO DE RESIDENCIA Y BUENA CONDUCTA ', 'Homo Clave', 'Es un documento expedido por el Secretario del Ayuntamiento que permite acreditar a los habitantes que son residentes de un lugar determinado dentro del municipio de Uruapan, Michoacán., y que han observado modo honesto de vida.', ' Se presenta la persona interesada ante la Secretaría del H. Ayuntamiento con los requisitos establecidos, los cuales se anexan a un expediente con la solicitud correspondiente, para su debido análisis técnico y así elaborar el dictamen final.', '', 0, '', '2 días hábiles ', '2 días hábiles ', NULL, 166, '', 'Permanente ', '1 Mes ', 'ciudadano/empresa', '', '', 'Lunes a Viernes de 08:00am a 12:00pm ', '', 2, '2019-10-07', '2019-10-07 18:00:03', 17, NULL, NULL, NULL, 1);
