INSERT INTO `tramites` VALUES (21, 2, NULL, 'CERTIFICADO DE RESIDENCIA (EN SUS DIFERENTES MODALIDADES) ', 'Homo Clave', 'Es un documento expedido por el Secretario del Ayuntamiento que permite acreditar a la persona que es residente de un lugar determinado dentro del municipio de Uruapan, Michoacán, y en su caso le permite acreditar la identidad de la persona.', 'Se presenta la persona interesada ante la Secretaría del H. Ayuntamiento con los requisitos establecidos, los cuales se anexan a un expediente con la solicitud correspondiente, para su debido análisis técnico y así elaborar el dictamen final.', '', 0, '', '1 día hábil ', '1 día hábil ', NULL, 166, '', 'Permanente ', '1 mes ', 'ciudadano/empresa', '', '', 'Lunes a Viernes 08:00am a 12:00pm ', '', 2, '2019-10-07', '2019-10-07 18:00:47', 17, NULL, NULL, NULL, 1);
