INSERT INTO `tramites` VALUES (23, 2, NULL, 'CERTIFICACIÓN DE PAGO DE PERPETUIDAD ', 'Homo Clave', 'Es el derecho de uso vitalicio a favor del usuario de mantener en una sepultura u osario determinado, un cadáver, miembros corpóreos, los restos áridos humanos o las cenizas producto de la incineración o cremación de los mismos, amparado por el pago de los derechos correspondientes, siempre y cuando el mismo siga destinado por la administración para ese propósito.', 'Se presenta la persona interesada ante la Secretaría del H. Ayuntamiento con los requisitos establecidos, los cuales se anexan a un expediente con la solicitud correspondiente, para su debido análisis técnico y así elaborar el dictamen final.', '', 0, '', '1 día hábil ', '1 día hábil ', NULL, 123, '', 'Permanente ', 'Indefinido ', 'ciudadano', '', '', 'Lunes a Viernes de 08:00am a 12:00pm ', '', 2, '2019-10-07', '2019-10-07 19:00:21', 17, NULL, NULL, NULL, 1);
