INSERT INTO `tramites` VALUES (36, 4, NULL, 'Queja o Denuncia', 'Homo Clave', 'Atender las Quejas o Denuncias presentadas por la ciudadanía con motivo de las deficiencias o irregularidades de los trámites o servicios que presten las oficinas, dependencias y entidades del Ayuntamiento de Uruapan, Michoacán; así como investigar aquellos actos cometidos por servidores públicos del Ayuntamiento que, en ejercicio de sus funciones, sean Contrarios a la Ley.', 'Trámite en Línea;\r\nIngresar a la página electrónica http://contraloria.uruapan.gob.mx, y emitir la queja o denuncia de manera anónima o personalizada.\r\n\r\nVía Telefónica;\r\nComunicarse vía telefónica al 452 52 40092 Ext. 206.\r\n\r\nPresencial;\r\nPresentar un escrito libre dirigido a la Contraloría Municipal, o mediante el formato de quejas y denuncias. En caso de ser por comparecencia; deberá presentarse en la Contraloría Municipal, para que personal de la Coordinación de Quejas, Denuncias y Sugerencias, tome la declaración relativa a su queja o denuncia.\r\nEn los trámites anteriores,  deberá indicar   nombre y dirección del quejoso (en caso de no ser queja o denuncia anónima ), nombre del servidor público en caso de tenerlo, Secretaría, Dirección o Departamento Municipal presuntamente responsable, narración clara y concisa de los hechos y si cuenta con algún medio de prueba anexarlo).\r\n', 'Dependerá del análisis de la información proporcionada por el ciudadano, en conjunto con las leyes, reglamentos y normatividad aplicable.\r\n', 0, '4fqUf84OVm_ghrx8pteuMahQ7dC_iRM7.rar', '45 días', '45 días', NULL, NULL, '', 'Permanente', 'Dependerá del análisis de la información proporcionada por el ciudadano, en conjunto con las leyes, reglamentos y normatividad aplicable; el periodo de conservación de la respuesta generada.', 'ciudadano/empresa', ' Artículo 59 fracción X de la Ley Orgánica Municipal del Estado de Michoacán de Ocampo.\r\nArticulo 42 Fracciones VIII y IX del  Reglamento Interno de la Administración Municipal de Uruapan, Michoacán.\r\nArtículos 49, 74, 75, 76, 92 y 93 Ley de Responsabilidades Administrativas del Estado de Michoacán de Ocampo.', 'NcEpooEG0cc9q_8Vrtv8XWW97t_nvn8V.rar', 'El tramite presencial, por comparecencia, y vía telefónica se puede realizar en un horario de 8:00 a 16:00 horas, el trámite en línea se puede realizar las 24:00 horas.', 'Requisitos en caso de denuncia presencial o por comparecencia; persona física presentar  1 copia de identificación oficial,  en caso de persona moral 1 Copia de acta constitutiva, 1 copia de Identificación de Representante o apoderado legal.\r\nEn caso de denuncia anónima adjuntar (fotografías, vídeos, grabaciones, o medio de prueba que sustente la queja o denuncia)', 2, '2019-10-10', '2019-10-10 18:00:46', 4, NULL, NULL, NULL, 1);
