INSERT INTO `tramites` VALUES (48, 2, NULL, 'PERMISO PARA COLOCAR CONCAVAS, MANTAS Y/O PENDONES ', 'Homo Clave', 'Es el permiso para colocar temporalmente cóncavas, mantas y pendones, para anuncios comerciales.', 'Se presenta la persona interesada ante la Secretaría del H. Ayuntamiento con los requisitos establecidos, los cuales se anexan a un expediente con la solicitud correspondiente, para su debido análisis técnico y así elaborar el dictamen final.', '', 0, '', '3 días hábiles ', '3 días hábiles ', NULL, 253, '', 'Permanente', 'Periodo Autorizado ', 'ciudadano/empresa', '', '', 'Lunes a Viernes de 08:00am a 12:00pm', '', 2, '2019-10-11', '2019-10-11 16:00:17', 17, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (49, 2, NULL, 'PERMISO PARA CIRCO', 'Homo Clave', 'Es el permiso para aquellos circos de instalación temporal, donde se desarrollan espectáculos variados con participación de atletas, payasos, ilusionistas, etc.', 'Se presenta la persona interesada ante la Secretaría del H. Ayuntamiento con los requisitos establecidos, los cuales se anexan a un expediente con la solicitud correspondiente, para su debido análisis técnico y así elaborar el dictamen final.', '', 0, '', '1 día hábil ', '1 día hábil ', NULL, NULL, 'Según sea la cantidad de boletaje vendido se cobrara el 5% sobre el total', 'Permanente', 'Periodo autorizado ', 'ciudadano/empresa', '', '', 'Lunes a Viernes de 08:00am a 12:00pm', '', 0, '2019-10-11', '2019-10-11 17:00:56', 17, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (50, 1, 2, 'Deslinde de predio ', 'Homo Clave', 'Es una verificación  que se realiza para distinguir los límites de una propiedad.', '1. Se recibe la solicitud y requisitos del ciudadano.\r\n2. El conciliador hace la visita a la propiedad verificando las medidas.\r\n3. Se hace el deslinde.\r\n4. Se entrega la resolución. ', '', 0, '', '7 Días hábiles', '15 Días hábiles ', NULL, NULL, '', 'Permanente', 'Permanente', 'ciudadano', 'Artículo 6 de la Ley de Justicia Alternativa y Restaurativa del Estado de Michoacán.\r\nArtículo 4 del Reglamento de la Dirección de Medicación y Conciliación Municipal.', '', 'Lunes a viernes de 08:00 a 16:00 hrs.', '', 2, '2019-10-15', '2019-10-15 14:00:49', 12, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (51, 1, 2, 'Rectificación de Medidas en Propiedades', 'Homo Clave', 'Es una verificación realizada para rectificar medidas en propiedades.', '1. Se recibe la solicitud y requisitos del ciudadano.\r\n2. El conciliador hace la visita a la propiedad verificando las medidas.\r\n3.  Se hace la rectificación.\r\n4. Se entrega la resolución. ', '', 0, '', '15 Días hábiles ', '20 Días hábiles ', NULL, NULL, '', 'Permanente ', 'Permanente', 'ciudadano', 'Artículo 6 de la Ley de Justicia Alternativa y Restaurativa del Estado de Michoacán. \r\nArtículo 4 del Reglamento de la Dirección de Medicación y Conciliación Municipal.', '', 'Lunes a viernes de 08:00 a 16:00 hrs. ', '', 2, '2019-10-15', '2019-10-15 15:00:27', 12, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (52, 1, 2, 'Problemas de humedad', 'Homo Clave', 'Se realiza una visita a la propiedad verificando los daños causados por la humedad.', '1. Se recibe la solicitud y requisitos del ciudadano. \r\n\r\n2. El conciliador hace la visita para verificar la humedad en la propiedad.\r\n\r\n3. Se mandan citatorios a los vecinos colindantes causantes de la humedad.', '', 0, '', '15 Días hábiles ', '20 Días hábiles ', NULL, NULL, '', 'Permanente', 'Permanente', 'ciudadano', 'Artículo 6 de la Ley de Justicia Alternativa y Restaurativa del Estado de Michoacán.\r\nArtículo 4 del Reglamento de la Dirección de Mediación y Conciliación Municipal.', '', 'Lunes a viernes de 08:00 a 16:00 hrs. ', '', 2, '2019-10-15', '2019-10-15 15:00:47', 12, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (53, 1, 2, 'Atención en conflictos vecinales ', 'Homo Clave', 'Se realizan o se envían citatorios a las personas involucradas en los conflictos.', '1. Se revisa la solicitud \r\n2. Se hacen los citatorios pertinentes para citar a los involucrados en el conflicto ', '', 0, '', '15 Días hábiles ', '20 Días hábiles', NULL, NULL, '', 'Permanente', 'Permanente', 'ciudadano', 'Artículo 6 de la Ley de Justicia Alternativa y Restaurativa del Estado de Michoacán.\r\nArtículo 4 del Reglamento de la Dirección de Mediación y Conciliación Municipal', '', 'Lunes a viernes de 08:00 a 16:00 hrs.', '', 2, NULL, NULL, 12, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (54, 1, 2, 'Atención en conflictos vecinales ', 'Homo Clave', 'Se realizan o se envían citatorios a las personas involucradas en los conflictos. ', '1. Se revisa la solicitud \r\n2. Se hacen los citatorios pertinentes para citar a los involucrados en el conflicto', '', 0, '', '15 Días hábiles ', '20 Días hábiles ', NULL, NULL, '', 'Permanente ', 'Permanente ', 'ciudadano', 'Artículo 6 de la Ley de Justicia Alternativa y Restaurativa del Estado de Michoacán.\r\nArtículo 4 del Reglamento de la Dirección de Mediación y Conciliación Municipal.', '', 'Lunes a viernes de 08:00 a 16:00 hrs. ', '', 2, '2019-10-15', '2019-10-15 16:00:58', 12, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (55, 1, 2, 'Rectificación de medidas en propiedades ', 'Homo Clave', 'Es una verificación realizada para rectificar medidas en propiedades.', '1. Se recibe la solicitud y los requisitos del ciudadano\r\n2. El conciliador hace la visita a la propiedad verificando las medidas \r\n3. Se hace la rectificación \r\n4. Se entrega la resolución ', '', 0, '', '15 Días hábiles ', '20 Días hábiles ', NULL, NULL, '', 'Permanente', 'Permanente', 'ciudadano', '', '', '', '', 2, '2019-10-16', '2019-10-16 13:00:46', 12, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (56, 1, NULL, 'Solicitudes de áreas para cuidado', 'Homo Clave', 'Solicitud de información sobre áreas verdes, resguardo de áreas para cuidado, protección y mantenimiento. ', '1. Presentar solicitud \r\n2. Esperar si es procedente\r\n3. Dependiendo de la naturaleza de los solicitantes deberán cumplir con distinta documentación general ', '', 0, '', '15 Días hábiles', '20 Días hábiles', NULL, NULL, '', 'Permanente ', 'Durante la administración vigente ', 'ciudadano', '', '', '', '', 2, '2019-10-16', '2019-10-16 13:00:16', 12, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (57, 1, 3, 'Solicitud de acceso a la información pública ', 'Homo Clave', 'Procedimiento de Acceso a la Información Pública que se encuentra en posesión de la Administración Pública', '1. Se recibe la solicitud de información física o digital \r\n2. Se turna oficio al área generadora o poseedora  de la información requerida, a fin de solicitar su informe para la elaboración del acuerdo de respuesta correspondiente para la debida atención ciudadana \r\n3. Una vez recibida la información solicitada,  se procede a su revisión y a la elaboración de un acuerdo de respuesta correspondiente y se notifica al solicitante', '', 0, '', '20 Días hábiles ', '25 Días hábiles ', NULL, NULL, 'Sin costo, y  en su caso el costo de envío o el pago de certificación de documentos cuando proceda.', 'Permanente ', 'Permanente', 'ciudadano/empresa', 'Periodo de prórroga fundamentado en el artículo 75 y de los costos para obtener la información en el artículo 69 de la Ley de Transparencia, Acceso a la Información y Protección de Datos Personales del Estado de Michoacán de Ocampo vigente.', '', '', '1. El tiempo de respuesta puede prorrogarse hasta 10 días adicionales de manera fundada y motivada.\r\n2. En caso de existir costos para obtener la información, deberán cubrirse de manera previa a la entrega.', 2, '2019-10-16', '2019-10-16 14:00:10', 12, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (58, 1, 3, 'Solicitud de Derechos de Acceso, Rectificación, Cancelación y Oposición ', 'Homo Clave', 'Solicitud de los Derechos de Acceso, Rectificación, Cancelación u Oposición al tratamiento de los datos personales que se encuentran en posesión de la Administración Pública Municipal.', '1. Se recibe la solicitud y requisitos del ciudadano \r\n2. Se turna el oficio al área generadora o poseedora de la información\r\n3. Una vez recibida la información solicitada, se procede a su revisión y la determinación de la respuesta \r\n4. Se elabora un acuerdo de Protección de Derechos  ARCO\r\n5. Se notifica al área y al solicitante ', '', 0, '', '20 Días hábiles ', '30 Días hábiles ', NULL, NULL, '', 'Permanente ', 'Permanente ', 'ciudadano/empresa', 'Costos para obtener la información fundamentado en el artículo 46 y del periodo de prórroga en el artículo 69 de la Ley de Protección de Datos Personales en Posesión de Sujetos Obligados del Estado de Michoacán de Ocampo, vigente.', '', '', '1. Sólo podrán realizarse cobros para recuperación de costos de reproducción, certificación o envío.\r\n2. El tiempo de respuesta puede prorrogarse hasta 10 días de manera fundada y motivada.', 2, '2019-10-16', '2019-10-16 10:00:24', 12, NULL, NULL, NULL, 1);
