di-language: AR-SA;\">El m&oacute;dulo de informaci&oacute;n hace saber al contribuyente por primera ves, sobre los requisitos necesarios para la obtenci&oacute;n de su licencia. Cuando el contribuyente presenta los documentos solicitados, se revisan y de no haber observaciones al respecto, se canaliza al m&oacute;dulo de atenci&oacute;n que se le indique. Ah&iacute; se capturan digitalmente los documentos y se le devuelven al contribuyente, posteriormente se genera la licencia, debiendo firmar el contribuyente el tal&oacute;n de recibido. La licencia deber&aacute; presentarse los primeros tres meses del siguiente a&ntilde;o para su resello y no generar multas o recargos.&nbsp;&nbsp;&nbsp; <br /></span></p>', '', 1, 'Rl3ozEMQKso2SPKfHihNhmcwDcPoc3Fj.pdf', '15 minutos', '30 minutos', NULL, NULL, '', 'Permanente', 'Anual', 'ciudadano/empresa', ' Reglamento Integral de Comercio, Industria y Servicios. ', '1QsBwsEkSqrNWHDdIJeYTCQWZpFWaXO9.pdf', '', 'Al margen de los requisitos básicos y dependiendo del giro comercial específico, se podrá solicitar adicionalmente:\r\nLicencia de Uso de Suelo.\r\nDictamen de Protección Civil.\r\nDictamen de Impacto Ambiental.\r\nRegistro de la SEMARNAT como generador de residuos peligrosos.\r\nVerificación de Inspectores Varios Ramos.\r\nCalibración de báscula emitido por la PROFECO', 2, '2019-10-17', '2019-10-17 23:00:00', 19, NULL, NULL, NULL, 1);
