\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"46\"\r\n   Name=\"List Table 1 Light Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 6\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Tabla normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:8.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:107%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]--><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Calibri; color: black; mso-ansi-language: ES-MX; mso-fareast-language: ES-MX; mso-bidi-language: AR-SA;\">El m&oacute;dulo de informaci&oacute;n hace saber al contribuyente por primera ves, sobre los requisitos necesarios para la obtenci&oacute;n de su licencia. Cuando el contribuyente presenta los documentos solicitados, se revisan y de no haber observaciones al respecto, se canaliza al m&oacute;dulo de atenci&oacute;n que se le indique. Ah&iacute; se capturan digitalmente los documentos y se le devuelven al contribuyente, posteriormente se genera la licencia, debiendo firmar el contribuyente el tal&oacute;n de recibido. La licencia deber&aacute; presentarse los primeros tres meses del siguiente a&ntilde;o para su resello y no generar multas o recargos.&nbsp;&nbsp; <br /></span></p>', '', 1, 'RrnkOXIyNuqWe89YO8XByyVHqURgo5XZ.pdf', '30 minutos', '45 minutos', NULL, NULL, '                       Giro                                                              Expedición            Resello         \r\nAbarrotes c/vta de cerveza.                                              30                            6              \r\nDeposito de cerveza.                                                          60                           12                      Abarrotes c/vta cerveza, vinos y licores.                    75                          15                         Vinaterías y Supermercados.                                        200                          40                  \r\nTienda de Autoservicio.                                                   800                        160              \r\nAuto Latas y Similares.                                                  1,000                       200               \r\nRestaurant c/vta de cerveza.                                           100                         20           \r\nRestaurant con vta de cerveza, vinos y licores.       200                         40                      Restaurant Bar y Peña                                                        600                         60                   \r\nCantinas.                                                                                   400                         80                \r\nCentro Botanero.                                                                 600                        120              \r\nBares.                                                                                       600                        120               \r\nDiscotecas.                                                                              850                       160               \r\nCentro Nocturno.                                                           1,100                          250', 'Permanente', 'Anual', 'ciudadano/empresa', 'Reglamento Integral de Comercio, Industria y Servicios. ', 'baM-xJBHD5nzYy4ah9S745gyoF5Q26ac.pdf', '', 'Las cuotas de derechos son equivalentes a días de salario mínimo (hoy denominado Unidad de Medida y Actualización UMA)  vigente en el Estado de Michoacán de conformidad con la Ley de Ingresos del Municipio de Uruapan, Michoacán.\r\n\r\nDependiendo del tipo de negocio se podrán solicitar alguno de los siguientes documentos:\r\n* Número oficial.\r\n* Licencia de uso de suelo.\r\n* Dictamen positivo de Inspectores Varios Ramos.\r\n* Dictamen positivo de Protección Civil.\r\n\r\nLa licencia de funcionamiento se entregará en un plazo de 30 días hábiles. Sin embargo, al momento de realizar el trámite y generar el pago correspondiente, con el comprobante de pago el ciudadano podrá iniciar actividades.\r\n', 2, '2019-10-18', '2019-10-18 19:00:19', 19, NULL, NULL, NULL, 1);
