oacute;n hace saber al contribuyente por primera ves, sobre los requisitos necesarios para la obtenci&oacute;n de su licencia de anuncios. Cuando el contribuyente presenta los documentos solicitados, se revisan y de no haber observaciones al respecto, se canaliza al m&oacute;dulo de atenci&oacute;n que se le indique. Ah&iacute; se capturan digitalmente los documentos y se le devuelven al contribuyente, posteriormente se genera la licencia, debiendo firmar el contribuyente el tal&oacute;n de recibido. La licencia deber&aacute; presentarse los primeros tres meses del siguiente a&ntilde;o para su resello y no generar multas o recargos. &nbsp;&nbsp; &nbsp; <br /></span></p>', '', 1, 'LuAH0Pvo-O99RcfkrkR_U7jr5bmHF_nh.pdf', '15 minutos', '30 minutos', NULL, NULL, 'Tipo de Anuncio                                   \r\nBandera   Espectacular   Electrónico\r\n 12 s.m.            24 s.m.                 36 s.m.             Expedición\r\n    3 s.m.              6 s.m.                   9 s.m.              Revalidación\r\n\r\n', 'Permanente', 'Anual', 'ciudadano/empresa', 'Reglamento de Anuncios.', 'WrSb7EcgfekvsBcSwCNxCy53NMRRe-P4.pdf', '', 'Un anuncio espectacular es igual o mayor a 6m.\r\nLas cuotas de derechos son equivalentes a días de salario mínimo (hoy denominado Unidad de Medida y Actualización UMA)  vigente en el Estado de Michoacán de conformidad con la Ley de Ingresos del Municipio de Uruapan, Michoacán.\r\n\r\nDependiendo de las dimensiones y posición del anuncio se podrá solicitar seguro de daños a terceros.\r\n\r\nDe igual forma, Licencia de Uso de Suelo y Dictamen de Impacto Ambiental.\r\n', 2, '2019-10-18', '2019-10-18 22:00:45', 19, NULL, NULL, NULL, 1);
