ri; color: black; mso-ansi-language: ES-MX; mso-fareast-language: ES-MX; mso-bidi-language: AR-SA;\">Presentarse al m&oacute;dulo correspondiente. Manifestar la situaci&oacute;n espec&iacute;fica bancaria. Orientaci&oacute;n particular sobre la queja. &nbsp;&nbsp; &nbsp; <br /></span></p>', '', 0, '', '45 días', '45 días', NULL, NULL, '', 'Permanente', 'No aplica', 'ciudadano', '', '', '', '', 2, '2019-10-18', '2019-10-18 22:00:05', 19, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (68, 7, 18, 'Apoyos de vialidad en eventos deportivos, eventos cívicos, desfiles, apoyos institucionales, eventos eclesiásticos, caravanas automovilísticas, etc.', 'Homo Clave', '<p>Se implementan dispositivos viales y se&ntilde;alizaci&oacute;n correspondiente, para salvaguardar la integridad f&iacute;sica de las personas que participan en los eventos donde lo soliciten.&nbsp;</p>', '<p>Se hace llegar a las Oficinas de Tr&aacute;nsito y Vialidad la solicitud por escrito, en los horarios de atenci&oacute;n al p&uacute;blico.</p>', '', 0, '', '2 horas', '24 horas ', NULL, NULL, '', 'Permanente', 'Hasta la fecha que se solicita ', 'ciudadano/empresa', 'Reglamento de Seguridad Pública, Tránsito y Vialidad Municipal, vigente en el municipio de Uruapan, Michoacán.', 'pz8rowTUVCxO9_5D4vmC8o-nYgpxBb6N.pdf', '', 'Estos trámites se realizan en coordinación con la Secretaría del Ayuntamiento, ya que es la instancia indicada para otorgar los permisos. Por parte de la Dirección de Tránsito solo se otorga el visto bueno, para utilizar la vialidades. \r\nEn las carreras atléticas se trabaja en coordinación con la Dirección de Deporte, quien otorga el visto bueno en relación a las medidas de seguridad de corredores.', 2, '2019-10-21', '2019-10-21 15:00:49', 6, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (69, 7, 19, 'Atención a víctimas. ', 'Homo Clave', '<p style=\"text-align: justify;\">Promover la integraci&oacute;n de grupos de promotores comunitarios y de redes sociales en materia de violencia familiar y sexual para informar, orientar, detectar y canalizar casos de violencia familiar o sexual, y promover el derecho a una vida sin violencia.&nbsp;</p>', '<p style=\"text-align: justify;\">El elemento de la polic&iacute;a de seguridad p&uacute;blica, traslada a la v&iacute;ctima a las instalaciones de dicha dependencia.</p>\r\n<p style=\"text-align: justify;\">Del &aacute;rea del conmutador se localiza a la persona en guardia de la Jefatura de Prevenci&oacute;n Social y Participaci&oacute;n Ciudadana.</p>\r\n<p style=\"text-align: justify;\">Se levanta el formato de ficha &uacute;nica donde vienen los datos personales de la v&iacute;ctima.</p>\r\n<p style=\"text-align: justify;\">Se le ofrece atenci&oacute;n y orientaci&oacute;n de que hacer (depende del caso de la v&iacute;ctima).</p>\r\n<p style=\"text-align: justify;\">Se le canaliza a las diferentes &aacute;reas seg&uacute;n sea el caso de las v&iacute;ctimas.&nbsp;</p>', '<p style=\"text-align: justify;\">La resoluci&oacute;n pac&iacute;fica de los conflictos, en coordinaci&oacute;n con las dependencias competentes.</p>', 0, '', 'Inmediata. ', '2 horas.', NULL, NULL, '', 'Permanente.', 'Sin documento emitido.', 'ciudadano', 'No aplica ', '', '24 HORAS ', 'La víctima se puede presentar en cualquier momento que lo desee, además no es necesario que presente algún tipo de documento para realizar el apoyo y orientación.', 2, '2019-10-21', '2019-10-21 16:00:21', 6, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (70, 7, 19, 'Atención a víctimas. ', 'Homo Clave', '<p style=\"text-align: justify;\">Promover la integraci&oacute;n de grupos de promotores comunitarios y de redes sociales en materia de violencia familiar y sexual para informar, orientar, detectar y canalizar casos de violencia familiar o sexual, y promover el derecho a una vida sin violencia.&nbsp;</p>', '<p style=\"text-align: justify;\">El elemento de la polic&iacute;a de seguridad p&uacute;blica, traslada a la v&iacute;ctima a las instalaciones de dicha dependencia.</p>\r\n<p style=\"text-align: justify;\">Del &aacute;rea del conmutador se localiza a la persona en guardia de la Jefatura de Prevenci&oacute;n Social y Participaci&oacute;n Ciudadana.</p>\r\n<p style=\"text-align: justify;\">Se levanta el formato de ficha &uacute;nica donde vienen los datos personales de la v&iacute;ctima.</p>\r\n<p style=\"text-align: justify;\">Se le ofrece atenci&oacute;n y orientaci&oacute;n de que hacer (depende del caso de la v&iacute;ctima).</p>\r\n<p style=\"text-align: justify;\">Se le canaliza a las diferentes &aacute;reas seg&uacute;n sea el caso de las v&iacute;ctimas.&nbsp;</p>', '<p style=\"text-align: justify;\">La resoluci&oacute;n pac&iacute;fica de los conflictos, en coordinaci&oacute;n con las dependencias competentes.</p>', 0, '', 'Inmediata. ', '2 horas.', NULL, NULL, '', 'Permanente.', 'Sin documento emitido.', 'ciudadano', 'No aplica ', '', '24 HORAS ', 'La víctima se puede presentar en cualquier momento que lo desee, además no es necesario que presente algún tipo de documento para realizar el apoyo y orientación.', 2, '2019-10-21', '2019-10-21 16:00:35', 6, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (71, 7, 19, 'Pláticas en las escuelas sobre prevención.', 'Homo Clave', '<p style=\"text-align: justify;\">Llevar pl&aacute;ticas a las escuelas, sobre la forma de prevenci&oacute;n de bullyn, violencia, drogadicci&oacute;n, prevenci&oacute;n del delito, escuela segura, entre otras.</p>', '<p>Se recibe la solicitud en forma escrita o verbal, por parte de la escuela.</p>\r\n<p>Se agenda la pl&aacute;tica de acuerdo a la carga de trabajo, tanto de la escuela como del &aacute;rea de prevenci&oacute;n social y participaci&oacute;n ciudadana.</p>\r\n<p>Personal de dicha &aacute;rea acude a dar las pl&aacute;ticas en las escuelas.&nbsp;</p>', '<p style=\"text-align: justify;\">Crear una cultura en materia de prevenci&oacute;n entre los jovenes y en el &aacute;mbito escolar, con el objetivo de contar con un municipio libre de violencia, adicciones&nbsp; entre los factores que afectan a la poblaci&oacute;n estudiantil<span style=\"color: #090d24; font-family: Lato, sans-serif;\"><span style=\"font-size: 18px; letter-spacing: 0.45px;\">.</span></span></p>', 0, '', '2 horas ', '24 horas ', NULL, NULL, '', 'Permanente.', 'Sin documento emitido.', 'empresa', 'No aplica.', '', '', '', 2, '2019-10-21', '2019-10-21 17:00:22', 6, NULL, NULL, NULL, 1);
