family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\">El empleador se registra en el padr&oacute;n de bolsa de trabajo municipal como una empresa legalmente constituida y su RFC. Registra la vacante donde se incluye el perfil que solicita, sueldo, horario, d&iacute;as de trabajo, edad y actividad a realizar.</span></p>\r\n<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Calibri; color: black; mso-ansi-language: ES-MX; mso-fareast-language: ES-MX; mso-bidi-language: AR-SA;\">El buscador de empleo<span style=\"mso-spacerun: yes;\">&nbsp; </span>se presenta en el m&oacute;dulo correspondiente donde se le orientar&aacute; sobre las vacantes. De haber una, se le vincula con el empleador para que acuda a una entrevista de trabajo.&nbsp;&nbsp; <br /></span></p>', '', 0, '', '15 minutos', '15 minutos', NULL, NULL, '', 'Permanente', 'No aplica', 'ciudadano', '', '', '', '', 2, '2019-10-22', '2019-10-22 13:00:10', 19, NULL, NULL, NULL, 1);
