INSERT INTO `tramites` VALUES (81, 7, 18, 'Carta de no antecedentes administrativos ', 'Homo Clave', '<p>Obtener una carta de no antecedentes administrativos para personas mayores de edad, principalmente para tr&aacute;mites laborales.</p>', '<p>Asistir a las Oficinas de la Secretar&iacute;a de Seguridad P&uacute;blica con la documentaci&oacute;n necesaria en horarios de recepci&oacute;n.</p>\r\n<p>En ese mismo d&iacute;a, venir a recoger su carta de no antecedentes administrativos.</p>', '<p>Expedir la carta de no antecedentes administrativos.</p>', 0, '', 'inmediatamente ', '24 horas ', NULL, 166, '', 'Permanente ', 'Un mes natural ', 'ciudadano', 'Ley de Ingresos del Municipio de Uruapan,\r\nMichoacán, para el Ejercicio Fiscal\r\ndel Año 2019.', 'RpCJR6iiQB8GbAPtuXwEGU2RuiY75wVK.pdf', '', 'Las fotografías se piden en papel  mate de lo contrario esta institución, no se hace responsable de la mala calidad del sello.', 2, '2019-10-22', '2019-10-22 19:00:39', 6, NULL, NULL, NULL, 1);
