e:EN-US;}\r\n</style>\r\n<![endif]--></p>\r\n<table class=\"MsoNormalTable\" style=\"width: 508px; border-collapse: collapse; height: 13px;\" border=\"0\" width=\"637\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr style=\"mso-yfti-irow: 0; mso-yfti-firstrow: yes; mso-yfti-lastrow: yes; height: 15.0pt;\">\r\n<td style=\"width: 478.0pt; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 0cm 3.5pt 0cm 3.5pt; height: 15.0pt;\" valign=\"bottom\" width=\"637\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\"><span lang=\"ES\" style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-ansi-language: ES; mso-fareast-language: ES-MX;\">Dependiendo del programa Federal o Estatal que exista en el momento, se hace la convocatoria a las MIPYMES mediante redes sociales o medios de comunicaci&oacute;n para que acudan al m&oacute;dulo de atenci&oacute;n correspondiente con los requisitos que el programa espec&iacute;fico requiera y se elaboren los expedientes particulares para enviarles ya sea a la federaci&oacute;n o al estado.&nbsp;&nbsp; <br /></span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', '', 0, '', 'Variable', 'Variable', NULL, NULL, '', 'Permanente', 'No aplica', 'ciudadano/empresa', '', '', '', 'El costo, tiempo de respuesta y requisitos a solicitar, depende de las bases específicas o particulares del programa (federal o estatal) que se trate.\r\n', 2, '2019-10-22', '2019-10-22 14:00:11', 19, NULL, NULL, NULL, 1);
