II INCISO A), B) DEL REGLAMENTO DE PASAPORTES Y DEL DOCUMENTO DE IDENTIDAD Y VIAJE.\r\n\r\nARTÍCULO 20, FRACCIÓN I, II, III, DEL REGLAMENTO DE PASAPORTES Y DEL DOCUMENTO DE IDENTIDAD Y VIAJE.\r\n\r\nARTÍCULO 21 DEL REGLAMENTO DE PASAPORTES Y DEL DOCUMENTO DE IDENTIDAD Y VIAJE.\r\nARTÍCULO 22 DEL REGLAMENTO DE PASAPORTES Y DEL DOCUMENTO DE IDENTIDAD Y VIAJE.\r\n\r\nARTÍCULO 23 DEL REGLAMENTO DE PASAPORTES Y DEL DOCUMENTO DE IDENTIDAD Y VIAJE.\r\n\r\nARTÍCULO 24 DEL REGLAMENTO DE PASAPORTES Y DEL DOCUMENTO DE IDENTIDAD Y VIAJE.\r\n\r\nARTÍCULO 25 DEL REGLAMENTO DE PASAPORTES Y DEL DOCUMENTO DE IDENTIDAD Y VIAJE.\r\n\r\nARTÍCULO 26 DEL REGLAMENTO DE PASAPORTES Y DEL DOCUMENTO DE IDENTIDAD Y VIAJE.\r\n\r\nARTÍCULO 27 DEL REGLAMENTO DE PASAPORTES Y DEL DOCUMENTO DE IDENTIDAD Y VIAJE.\r\n\r\nARTÍCULO 28 FRACCIÓN I, INCISO B), C) FRACCIÓN I BIS, II, III DEL REGLAMENTO DE PASAPORTES Y DEL DOCUMENTO DE IDENTIDAD Y VIAJE.\r\n\r\nARTÍCULO 29 FRACCIÓN I, II, III, V, VI, VII DEL REGLAMENTO DE PASAPORTES Y DEL DOCUMENTO DE IDENTIDAD Y VIAJE.\r\n\r\nARTÍCULO 30 DEL REGLAMENTO DE PASAPORTES Y DEL DOCUMENTO DE IDENTIDAD Y VIAJE.\r\n\r\nARTÍCULO 31 DEL REGLAMENTO DE PASAPORTES Y DEL DOCUMENTO DE IDENTIDAD Y VIAJE.\r\n\r\nARTÍCULO 32 DEL REGLAMENTO DE PASAPORTES Y DEL DOCUMENTO DE IDENTIDAD Y VIAJE.\r\n', 'tNtYZMtaLOqTfWfoCrub-nddmKcxc9BR.pdf', '', 'EL SOLICITANTE DEBERÁ REALIZAR UN PAGO FEDERAL, MISMO QUE PODRÁ REALIZAR EN CUALQUIER INSTITUCIÓN BANCARIA, CON LAS DATOS ESPECIFICADOS EN EL FORMATO DE \"PAGO FEDERAL\".', 2, '2019-10-29', '2019-10-29 00:00:12', 9, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (89, 13, 34, 'Módulo de Atención e Información ', 'Homo Clave', '<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: ES-MX; mso-fareast-language: ES-MX; mso-bidi-language: AR-SA;\">Se brinda la informaci&oacute;n a la ciudadana y canaliza al &aacute;rea correspondiente. </span><u></u><span style=\"text-decoration: line-through;\"></span></p>', '<p>&nbsp;</p>\r\n<div style=\"mso-element: frame; mso-element-frame-hspace: 7.05pt; mso-element-wrap: around; mso-element-anchor-vertical: paragraph; mso-element-anchor-horizontal: column; mso-element-top: -16.8pt; mso-height-rule: exactly;\">\r\n<div style=\"mso-element: frame; mso-element-frame-hspace: 7.05pt; mso-element-wrap: around; mso-element-anchor-vertical: paragraph; mso-element-anchor-horizontal: column; mso-element-top: -16.8pt; mso-height-rule: exactly;\">\r\n<table cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td style=\"padding: 0cm 7.05pt 0cm 7.05pt;\" align=\"left\" valign=\"top\">\r\n<p style=\"margin-bottom: .0001pt; mso-add-space: auto; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1; mso-element: frame; mso-element-frame-hspace: 7.05pt; mso-element-wrap: around; mso-element-anchor-vertical: paragraph; mso-element-anchor-horizontal: column; mso-element-top: -16.8pt; mso-height-rule: exactly;\"><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\"><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp; </span></span></span><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\">Se recibe a la ciudadana y se le pregunta el motivo por el cual acude al Instituto. </span></p>\r\n<p style=\"margin-bottom: .0001pt; mso-add-space: auto; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1; mso-element: frame; mso-element-frame-hspace: 7.05pt; mso-element-wrap: around; mso-element-anchor-vertical: paragraph; mso-element-anchor-horizontal: column; mso-element-top: -16.8pt; mso-height-rule: exactly;\"><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\"><span style=\"mso-list: Ignore;\">2.</span></span><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\">Se realiza un llenado<span style=\"mso-spacerun: yes;\">&nbsp; </span>de la solicitud de primera vez</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: ES-MX; mso-fareast-language: ES-MX; mso-bidi-language: AR-SA;\">Se canaliza al<span style=\"mso-spacerun: yes;\">&nbsp; </span>&aacute;rea correspondiente.&nbsp;&nbsp;</span><u></u><span style=\"text-decoration: line-through;\"></span></div>\r\n<p>&nbsp;</p>', '', 1, '7sKG4ZOFG3leaMYnU1yVbqYxHnGJv1_t.pdf', '10 minutos', '30 minutos', NULL, NULL, '', 'permante ', 'indefinido ', 'ciudadano', 'Reglamento Interno de la Administración Municipal Art. 84  ', '', '', '', 2, '2019-10-29', '2019-10-29 16:00:40', 10, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (90, 13, 34, 'Asesoría Jurídica ', 'Homo Clave', '<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-ansi-language: ES-MX; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Es un servicio que brinda Instituto a trav&eacute;s del &aacute;rea jur&iacute;dica, en donde se define la problem&aacute;tica que presenta la ciudadana, y a su vez,<span style=\"mso-spacerun: yes;\">&nbsp; </span>si es competencia del Instituto se inicia con el tr&aacute;mite. </span><u></u><span style=\"text-decoration: line-through;\"></span></p>', '<p>&nbsp;</p>\r\n<p style=\"text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\"> &nbsp; &nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se atiende a la ciudadana que requiere la asesor&iacute;a. </span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">2. </span></span><span style=\"mso-bidi-font-family: Arial;\">Se llena una c&eacute;dula de registro &uacute;nico (CRU).</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">3.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Agendar cita en trabajo social para estudio socioecon&oacute;mico. </span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: justify; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">4 </span></span><span style=\"mso-bidi-font-family: Arial;\">Revisi&oacute;n y valoraci&oacute;n del estudio socioecon&oacute;mico para determinar si es candidata para llevar el proceso jur&iacute;dico.</span></p>\r\n<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-ansi-language: ES-MX; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Si aprueba el estudio se solicita la documentaci&oacute;n necesaria para su tr&aacute;mite, en caso de no aprobarlo se canaliza a la defensor&iacute;a p&uacute;blica<span style=\"mso-spacerun: yes;\">&nbsp; </span>o a otra dependencia. </span><u></u><span style=\"text-decoration: line-through;\"></span></p>', '', 1, 'LEpaFZ5gv3ftYGa7IvGdXqj_H5jxPZAC.pdf', '10 minutos ', '60 minutos ', NULL, NULL, '', 'permanente', 'indefinido ', 'ciudadano', 'Reglamento Interno de la Administración Municipal Art. 84   ', 'Dk714Y3dC_3ogol57J8p5B5FL_MaUjoe.pdf', '', '', 2, '2019-10-29', '2019-10-29 17:00:11', 10, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (91, 13, 34, 'Divorcio Administrativo', 'Homo Clave', '<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-ansi-language: ES-MX; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Es un tr&aacute;mite que se implementa con parejas que sufren violencia, no tienen hijos o bien todos son mayores de edad, adem&aacute;s que no est&aacute;n en litigio bienes inmuebles propiedad de alguno de los c&oacute;nyuges.</span></p>', '<p>&nbsp;</p>\r\n<p style=\"text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\"> &nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se presenta la ciudadana que lo requiera.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">2.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se llena una c&eacute;dula de registro &uacute;nico (CRU).</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">3.<span style=\"font: 7.0pt \'Times New Roman\';\"> &nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se agenda cita en el &aacute;rea de trabajo social para estudio socioecon&oacute;mico. </span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">4.<span style=\"font: 7.0pt \'Times New Roman\';\"> &nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Revisi&oacute;n y valoraci&oacute;n del estudio socioecon&oacute;mico para determinar si es candidata para llevar el proceso jur&iacute;dico.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">5.<span style=\"font: 7.0pt \'Times New Roman\';\"> &nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Recepci&oacute;n de documentaci&oacute;n.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">6. </span></span><span style=\"mso-bidi-font-family: Arial;\">Se realiza la demanda por parte del &aacute;rea jur&iacute;dica del Instituto.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">7.<span style=\"font: 7.0pt \'Times New Roman\';\"> &nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Instituto Municipal de la Mujer presenta la demanda en la oficina de la oficial&iacute;a de partes, en donde determina en que juzgado de 1ra instancia en materia familiar se llevar&aacute; el caso.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">8. </span></span><span style=\"mso-bidi-font-family: Arial;\">El Instituto Municipal de la mujer se presenta en las diferentes audiencias que as&iacute; solicite el Juez en materia familiar hasta concluir el proceso. </span></p>\r\n<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-ansi-language: ES-MX; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Se entrega la Sentencia a la ciudadana por el Juez en materia familiar.</span><u></u><span style=\"text-decoration: line-through;\"></span></p>', '', 1, 'oy8Urx812NbEyxxrR1RjmDifdeebt3fa.pdf', '30 minutos ', '8 meses ', NULL, NULL, '', 'permanente', 'permanente ', 'ciudadano', 'Código familiar  del Estado de Michoacán ', 'eem8LSx076K2juOC8GRlaecD4COoCRY0.pdf', '', '', 2, '2019-10-29', '2019-10-29 17:00:34', 10, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (92, 13, 34, '  Divorcio sin Expresión de Causa', 'Homo Clave', '<p style=\"text-align: left;\"><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-ansi-language: ES-MX; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Este tipo de divorcio se tramita cuando se mand&oacute; citar a la pareja de la ciudadana, acudi&oacute; pero no llegamos a ning&uacute;n acuerdo, o bien, no se mand&oacute; citar porque haya expresado la ciudadana que no es su inter&eacute;s atender la situaci&oacute;n.</span><u></u><span style=\"text-decoration: line-through;\"></span></p>', '<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se presenta la ciudadana que lo requiera.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">2.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se llena una c&eacute;dula de registro &uacute;nico (CRU).</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">3.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Agendar cita en trabajo social para estudio socioecon&oacute;mico. </span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">4.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Revisi&oacute;n y valoraci&oacute;n del estudio socioecon&oacute;mico para determinar si es candidata para llevar el proceso jur&iacute;dico.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">5.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se reciben los documentos.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">6.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se realiza la demanda por parte del &aacute;rea jur&iacute;dica del Instituto.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">7.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Instituto Municipal de la Mujer presenta la demanda en la oficina de la oficial&iacute;a de partes, en donde determina en que juzgado de 1ra instancia en materia familiar llevar&aacute; el caso.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri;