 mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">8.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">El Instituto Municipal de mujer se presenta en las diferentes audiencias que as&iacute; solicite el Juez en materia familiar hasta concluir el proceso.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-ansi-language: ES-MX; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>El Juez en materia familiar hace entrega la sentencia.</span><u></u><span style=\"text-decoration: line-through;\"></span></p>', '', 1, 'KSJkFUVVwpPftLF8xz7dgI3Nq2v1v121.pdf', '30 minutos', '8 meses', NULL, NULL, '', 'permanente ', 'permanente ', 'ciudadano', 'Código familiar  del Estado de Michoacán ', 'MOYk4MP4a06demQiSI0byVRNDef_pZ-B.pdf', '', '', 2, '2019-10-29', '2019-10-29 17:00:50', 10, NULL, NULL, NULL, 1);
