atin;\"><span style=\"mso-list: Ignore;\">8.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">El Instituto Municipal de mujer se presenta en las diferentes audiencias que as&iacute; solicite el Juez en materia familiar hasta concluir el proceso.</span></p>\r\n<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-ansi-language: ES-MX; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>El Juez en materia familiar hace entrega la sentencia.</span><u></u><span style=\"text-decoration: line-through;\"></span></p>', '', 1, 'RavqqJdmtiBVOsaxW2bwaRcc5ZUZ0ND9.pdf', '30 minutos ', '8 meses', NULL, NULL, '', 'permanente ', 'permanente ', 'ciudadano', 'Código familiar  del Estado de Michoacán ', '', '', '', 2, '2019-10-29', '2019-10-29 18:00:15', 10, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (104, 13, 34, 'Divorcio por mutuo consentimiento', 'Homo Clave', '<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-ansi-language: ES-MX; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Es un tr&aacute;mite que se lleva a cabo con voluntad de las partes.</span><u></u><span style=\"text-decoration: line-through;\"></span></p>', '<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se presenta la ciudadana que lo requiera.</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">2.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se llena una c&eacute;dula de registro &uacute;nico (CRU).</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">3.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Agendar cita en trabajo social para estudio socioecon&oacute;mico. </span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">4.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Revisi&oacute;n y valoraci&oacute;n del estudio socioecon&oacute;mico para determinar si es candidata para llevar el proceso jur&iacute;dico.</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">5.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se cita a la pareja donde se llega a un acuerdo</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">6.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se reciben los documentos.</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">7.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se realiza la demanda por parte del &aacute;rea jur&iacute;dica del Instituto.</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">8.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&