INSERT INTO `tramites` VALUES (105, 13, 34, 'Pensión Alimenticia', 'Homo Clave', '<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-ansi-language: ES-MX; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Juicio que se tramita para pensi&oacute;n alimenticia, cuando la ciudadana vivi&oacute; en uni&oacute;n libre con su pareja con la que procre&oacute; hijos</span><u></u></p>', '<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se presenta la ciudadana que lo requiera.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">2.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se llena una c&eacute;dula de registro &uacute;nico (CRU).</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">3.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Agendar cita en trabajo social para estudio socioecon&oacute;mico. </span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">4.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Revisi&oacute;n y valoraci&oacute;n del estudio socioecon&oacute;mico para determinar si es candidata para llevar el proceso jur&iacute;dico.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">5.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se reciben los documentos.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">6.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se realiza la demanda por parte del &aacute;rea jur&iacute;dica del Instituto.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">7.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Instituto Municipal de Mujer presenta la demanda en la oficina de la oficial&iacute;a de partes, en donde determina en que juzgado de 1ra instancia en materia familiar llevara el caso.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">8.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">El Instituto Municipal de mujer se presenta en las diferentes audiencias que as&iacute; solicite el Juez en materia familiar hasta concluir el proceso.</span></p>\r\n<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-ansi-language: ES-MX; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>El Juez en materia familiar hace Se entrega la Sentencia.</span><u></u></p>', '', 1, 'nkDcKEjFyC0IXEOuXqyFg4OzMdegI121.pdf', '30 minutos ', '8 meses ', NULL, NULL, '', 'permanente ', 'permanente ', 'ciudadano', 'Código familiar  del Estado de Michoacán ', '', '', '', 2, '2019-10-29', '2019-10-29 18:00:16', 10, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (106, 13, 34, 'Orden de Protección ante la Sindico ', 'Homo Clave', '<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-ansi-language: ES-MX; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Se trata de una medida cautelar, la cual se solicita cuando las parejas ya no comparten domicilio conyugal, pero contin&uacute;an teniendo problemas entre ellos, y la integridad de la solicitante est&aacute; en riesgo.</span><u></u><span style=\"text-decoration: line-through;\"></span></p>', '<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se presenta la ciudadana que lo requiera.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">2.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se llena una c&eacute;dula de registro &uacute;nico (CRU).</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">3.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Realizaci&oacute;n de oficio en donde se solicita a la S&iacute;ndico Municipal la orden de protecci&oacute;n y la<span style=\"mso-spacerun: yes;\">&nbsp; </span>firma la Secretaria de Perspectiva de G&eacute;nero e Inclusi&oacute;n.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">4.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">En caso de que su tr&aacute;mite jur&iacute;dico sea competencia del Instituto se solicita la documentaci&oacute;n para iniciar con su tr&aacute;mite.</span></p>\r\n<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-ansi-language: ES-MX; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Instituto Municipal de Mujer<span style=\"mso-spacerun: yes;\">&nbsp; </span>hace entrega de la orden protecci&oacute;n a la ciudadana</span><u></u><span style=\"text-decoration: line-through;\"></span></p>', '', 1, 'hbQO4PYm1xVb95kkTMJKH4guKwtUtNQP.pdf', '30 minutos ', '5 dias ', NULL, NULL, '', 'permanente ', 'permanente ', 'ciudadano', 'Reglamento Interno de la Administración Municipal Art. 84   ', 'iafFLWH_mNbG6H53FQRP1-vUfRPAgmVL.pdf', '', '', 2, '2019-10-29', '2019-10-29 18:00:32', 10, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (107, 13, 34, 'Atención Psicológica', 'Homo Clave', '<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: ES-MX; mso-fareast-language: ES-MX; mso-bidi-language: AR-SA;\">Se proporciona terapia a las mujeres y/o parejas que lo requieran con previa valoraci&oacute;n.</span><u></u><span style=\"text-decoration: line-through;\"></span></p>', '<p style=\"margin: 0cm 0cm 0pt 20.25pt; line-height: normal;\"><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\">Se entrevista a la persona.</span></p>\r\n<p style=\"mso-add-space: auto; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1; margin: 0cm 0cm .0001pt 38.25pt;\">&nbsp;</p>\r\n<p style=\"line-height: normal; margin: 0cm 0cm .0001pt 20.25pt;\"><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\">Se detecta su motivo de consulta.</span></p>\r\n<p style=\"mso-add-space: auto; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1; margin: 0cm 0cm .0001pt 38.25pt;\">&nbsp;</p>\r\n<p style=\"line-height: normal; margin: 0cm 0cm .0001pt 20.25pt;\"><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\">Se asigna cita para su proceso de terapia.</span></p>\r\n<p style=\"mso-add-space: auto; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1; margin: 0cm 0cm .0001pt 38.25pt;\">&nbsp;</p>\r\n<p style=\"line-height: normal; margin: 0cm 0cm .0001pt 20.25pt;\"><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\">Se atiende de forma individual o de pareja al paciente en proceso.</span></p>\r\n<p style=\"line-height: normal; margin: 0cm 0cm .0001pt 20.25pt;\"><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>Se da seguimiento<span style=\"mso-spacerun: yes;\">&nbsp; </span>a trav&eacute;s de las diferentes sesiones hasta dar alta</span></p>\r\n<p style=\"mso-add-space: auto; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1; margin: 0cm 0cm .0001pt 38.25pt;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: ES-MX; mso-fareast-language: ES-MX; mso-bidi-language: AR-SA;\">&nbsp;</span>&nbsp;</p>\r\n<p>&nbsp;</p>', '', 1, 'nPrxzMlMAI16tl-D2VXU_rdhLXeScmwj.pdf', '5 minutos', 'Indefinido  ', NULL, NULL, '', 'permanente ', 'permanente ', 'ciudadano', 'Reglamento Interno de la Administración Municipal Art. 84.  ', 'bf9ghPI0Kl9ztvyrrr6X0Vf3nug88qNt.pdf', '', '', 2, '2019-10-29', '2019-10-29 18:00:21', 10, NULL, NULL, NULL, 1);
