mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\">Se atiende de forma individual o de pareja al paciente en proceso.</span></p>\r\n<p style=\"line-height: normal; margin: 0cm 0cm .0001pt 20.25pt;\"><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>Se da seguimiento<span style=\"mso-spacerun: yes;\">&nbsp; </span>a trav&eacute;s de las diferentes sesiones hasta dar alta</span></p>\r\n<p style=\"mso-add-space: auto; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1; margin: 0cm 0cm .0001pt 38.25pt;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: ES-MX; mso-fareast-language: ES-MX; mso-bidi-language: AR-SA;\">&nbsp;</span>&nbsp;</p>\r\n<p>&nbsp;</p>', '', 1, 'I0Umfa67OQa1oY870TilliZ7FRym5cEK.pdf', '5 minutos', 'Indefinido  ', NULL, NULL, '', 'permanente ', 'permanente ', 'ciudadano', 'Reglamento Interno de la Administración Municipal Art. 84.  ', 'EUY_KJ-AuA0Q0ZV4OZSSEANkbv8earss.pdf', '', '', 2, '2019-10-29', '2019-10-29 18:00:58', 10, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (109, 13, 34, 'Talleres de Prevención a la Violencia  ', 'Homo Clave', '<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: ES-MX; mso-fareast-language: ES-MX; mso-bidi-language: AR-SA;\">&nbsp;Se trabaja en cada taller un tema con apoyo de presentaciones, din&aacute;micas y ejercicios que permiten a los participantes sensibilizarse en la erradicaci&oacute;n de la violencia.</span><u></u><span style=\"text-decoration: line-through;\"></span></p>', '<p>&nbsp;</p>\r\n<p style=\"text-align: left; line-height: normal; text-indent: -18pt; margin-bottom: 0pt;\"><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\"><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\">Entrega de una solicitud por parte del interesado dirigida a la Directora.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; line-height: normal; text-indent: -18pt; margin-bottom: 0pt;\"><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\"><span style=\"mso-list: Ignore;\">2.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\">Revisar el tema y agendar