INSERT INTO `tramites` VALUES (124, 13, 36, 'Préstamo de equipo de cómputo y acceso a internet ', 'Homo Clave', '<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: ES-MX; mso-fareast-language: ES-MX; mso-bidi-language: AR-SA;\">Se brinda pr&eacute;stamo de equipos de c&oacute;mputo y acceso gratuito a internet.</span><u></u></p>', '<p>&nbsp;</p>\r\n<p style=\"text-align: left; line-height: normal; text-indent: -18pt; margin-bottom: 0pt;\"><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\"><span style=\"mso-list: Ignore;\">1. </span></span><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\">Se presenta el joven solicitando el pr&eacute;stamo del equipo.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; line-height: normal; text-indent: -18pt; margin-bottom: 0pt;\"><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\"><span style=\"mso-list: Ignore;\">2.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\">Se registra para poder acceder.</span></p>\r\n<p>&nbsp;</p>', '', 0, '', '5 minutos', '8 horas', NULL, NULL, '', 'permanente ', 'No aplica ', 'ciudadano', 'Reglamento Interno de la Administración Municipal Art. 86   ', 'k2-5lmyl2xRcDcZ_YtCHVNattWKeTKvf.pdf', '', 'el tipo de resolución es el préstamo de computadoras e internet ', 2, '2019-10-29', '2019-10-29 19:00:10', 10, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (125, 13, 34, 'Divorcio Administrativo', 'Homo Clave', '<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-ansi-language: ES-MX; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Es un tr&aacute;mite que se implementa con parejas que sufren violencia, no tienen hijos o bien todos son mayores de edad, adem&aacute;s que no est&aacute;n en litigio bienes inmuebles propiedad de alguno de los c&oacute;nyuges.</span><u></u><span style=\"text-decoration: line-through;\"></span></p>', '<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se presenta la ciudadana que lo requiera.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">2.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se llena una c&eacute;dula de registro &uacute;nico (CRU).</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">3.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se agenda cita en el &aacute;rea de trabajo social para estudio socioecon&oacute;mico. </span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">4.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Revisi&oacute;n y valoraci&oacute;n del estudio socioecon&oacute;mico para determinar si es candidata para llevar el proceso jur&iacute;dico.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">5.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Recepci&oacute;n de documentaci&oacute;n.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">6.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Se realiza la demanda por parte del &aacute;rea jur&iacute;dica del Instituto.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">7.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">Instituto Municipal de la Mujer presenta la demanda en la oficina de la oficial&iacute;a de partes, en donde determina en que juzgado de 1ra instancia en materia familiar se llevar&aacute; el caso.</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left; text-indent: -18pt;\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"><span style=\"mso-list: Ignore;\">8.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"mso-bidi-font-family: Arial;\">El Instituto Municipal de la mujer se presenta en las diferentes audiencias que as&iacute; solicite el Juez en materia familiar hasta concluir el proceso. </span></p>\r\n<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-ansi-language: ES-MX; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Se entrega la Sentencia a la ciudadana por el Juez en materia familiar.</span><u></u><span style=\"text-decoration: line-through;\"></span></p>', '', 1, 'dFGeJgz6SckiVjJfqcXh7AVjbnWcrCQC.pdf', '30 minutos ', '8 meses ', NULL, NULL, '', 'permanente ', 'permanente ', 'ciudadano', 'Reglamento Interno de la Administración Municipal Art. 84  ', 'siLphbvOSfCKBoXS36yotknvA56UsVhy.pdf', '', '', 2, '2019-10-29', '2019-10-29 20:00:12', 10, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (126, 8, 20, 'Asesoría Jurídica', 'Homo Clave', '<p>&nbsp;</p>\r\n<p class=\"western\" style=\"margin-bottom: 0cm; line-height: 100%; text-align: justify;\" align=\"center\"><span style=\"color: #000000;\">Brindar Asesor&iacute;a y orientaci&oacute;n jur&iacute;dica a la ciudadan&iacute;a que lo requiera y en su caso canalizarlas a las dependencias u &oacute;rganos competentes.</span></p>', '<p class=\"western\" style=\"margin-bottom: 0cm; line-height: 100%; text-align: left;\" align=\"center\"><span style=\"color: #000000;\">1.- Acudir al departamento.</span></p>\r\n<p class=\"western\" style=\"margin-bottom: 0cm; line-height: 100%; text-align: left;\" align=\"center\"><span style=\"color: #000000;\"> 2.- Se canaliza la Orientaci&oacute;n con el asesor.</span></p>\r\n<p class=\"western\" style=\"margin-bottom: 0cm; line-height: 100%; text-align: left;\" align=\"center\"><span style=\"color: #000000;\">3.- Se analiza el problema y se brinda la orientaci&oacute;n jur&iacute;dica .</span></p>', '<p>inmediato</p>', 0, '', '25 minutos ', '60 minutos ', NULL, NULL, '', 'No Aplica', 'No Aplica', 'ciudadano', 'Artículo 60 fracción VIII del Reglamento Interno de la Administración Municipal de Uruapan, Michoacán', 'OT6WVF10eQRljWdSfsJ14H8fob3nhyJe.pdf', '', 'Ninguna', 2, '2019-11-04', '2019-11-04 17:00:37', 18, NULL, NULL, NULL, 1);
