INSERT INTO `tramites` VALUES (128, 15, 40, 'AVES DE TRASPATIO DE DOBLE PROPOSITO (HUEVO Y CARNE)', 'Homo Clave', '<p>P<strong>ROVEER DE AVES DE TRASPATIO DE DOBLE PROPOSITO (HUEVO Y CARNE)</strong></p>', '<p><strong>PRESENTAR SOLICITUD DE APOYO&nbsp;</strong></p>\r\n<p><strong>SOLO PARA COMUNIDADES RURALES&nbsp;</strong></p>', '<p><strong>SOLO ES PARA LA ZONA RURAL&nbsp;</strong></p>', 0, '', '60 DIAS', '90', NULL, 200, '', '90 ', '90', 'ciudadano', '', '', '', '', 2, '2019-11-07', '2019-11-07 19:00:31', 16, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (129, 15, 40, 'ARBOLES FRUTALES', 'Homo Clave', '<p><strong>APOYO PARA AGRICULTORES DE LOS DIFERENTES EJIDOS Y COMUNIDADES DEL MUNICIPIO</strong></p>', '<p>&nbsp;<strong>SE DEJA SOLICITUD Y LA DOCUMENTACION REQUERIDA&nbsp;</strong></p>\r\n<p><strong>SE REALIZA SUPERVISION&nbsp;</strong></p>', '<p><strong>QUE NO SEA BENEFICIARIO DE OTRO PROGRAMA&nbsp;</strong></p>', 0, '', '10', '20', NULL, NULL, '$3.00\r\n$10.00', '1 MES', '1 MES ', 'ciudadano', '', '', '', '', 2, '2019-11-07', '2019-11-07 20:00:36', 16, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (130, 15, 40, 'DOTACIÓN DE LOMBRIZ', 'Homo Clave', '<p>SE DOTARA DE LOMBRIZ ROJA CALIFORNIA PARA FOMENTAR EL USO DE ABONOS ORGANICOS EN LA PRODUCCION AGRICOLA</p>', '<p>SE DEBE DE REALIZAR UNA SOLICITUD LIBRE Y SE REALIZA SUPERVISION POR PARTE DE PERSONAL DE LA DIRECCION DE DESARROLLO RURAL</p>', '<p>SE ENTREGA EL APOYO A LOS PRODUCTORES QUE DEMUESTREN QUE REALMENTE LO NECESITAN</p>\r\n<p>&nbsp;</p>', 0, '', '10', '20', NULL, NULL, '', '1 MES', '1 MES', 'ciudadano', '', '', '', '', 2, '2019-11-07', '2019-11-07 20:00:11', 16, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (131, 7, 19, 'Atención a adultos mayores ', 'Homo Clave', '<p>Apoyo y orientacion a adultos mayores extraviados o en situaci&oacute;n de riesgo.</p>', '<p>*Los elementos de seguridad p&uacute;blica, trasladan al adutlo mayor a las oficinas de la secretaria.</p>\r\n<p>*El &aacute;rea de conmutador se comunica con la persona en guardia para que lo asista.</p>\r\n<p>*Se levanta una ficha de datos.</p>\r\n<p>*Se toma una fotograf&iacute;a al adulto mayor para ser publicada en las redes sociales, y dar con sus familiares o domicilio.</p>\r\n<p>*Se entrega a su familia y se toma una fotograf&iacute;a con su familiar.</p>', '<p>Que el adulto mayor se re&uacute;na con sus familiares.</p>', 0, '', 'Inmediatamente ', 'Inmediatamente ', NULL, NULL, '', 'Permanente ', 'No aplica', 'ciudadano', 'No aplica ', '', 'Las 24 horas al día, los 7 días de la semana.', '', 2, '2019-11-11', '2019-11-11 19:00:23', 6, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (132, 7, 19, 'Atención a menores infractores', 'Homo Clave', '<p>Apoyo y asistencia a los menores infractores.</p>', '<p>*Los elementos de seguridad p&uacute;blica traen al menor infractora las oficinas de seguridad p&uacute;bica y revisan que sea menor de edad para canalizarlo a la Jefatura de Prevenci&oacute;n Social.</p>\r\n<p>*Dan aviso a la persona que est&aacute; de guardia en el &aacute;rea de Prevenci&oacute;n Social y participaci&oacute;n ciudadana.</p>\r\n<p>*Est&aacute; se encarga de localizar a sus padres, donde se le comenta la situacion del menor y con autorizaci&oacute;n de ellos se ve la posiblidad de canalizar o no al menor.</p>\r\n<p>*La persona de guardia pl&aacute;tica con el menor infractor y sus padres para crear conciencia de los actos que lo llevaron a infrigir dandole orientacion para que no vuelva a incurrir en faltas administrativas.</p>\r\n<p>* Finalmente el menor es entregado a sus padres donde se toma una fotograf&iacute;a.</p>', '<p>Orientar y proteger al menor con el objetivo que comprenda las consecuencias de sus actos y no vuelva a delinquir.</p>', 0, '', 'Inmediato ', 'Inmediato ', NULL, NULL, '', 'Permanente', 'No aplica', 'ciudadano', 'No aplica ', '', '24 horas al día, los 7 días de la semana.', '', 2, '2019-11-11', '2019-11-11 20:00:44', 6, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (133, 7, 18, 'Arrastre de Grúa', 'Homo Clave', '<p>Los arrastres son la remoci&oacute;n de veh&iacute;culos mal estacionados al dep&oacute;sito de veh&iacute;culos por infracci&oacute;n de tr&aacute;nsito.&nbsp;</p>\r\n<p>Arrastres de veh&iacute;culos del servicio p&uacute;bico, tipo t&aacute;xi, siniestrados en hechos de tr&aacute;nsito.</p>', '<p>*Asistir a la Direcci&oacute;n de Tr&aacute;nsito y Vialidad al &aacute;rea de infracciones, con la documentaci&oacute;n necesaria para la realizaci&oacute;n del tr&aacute;mite.</p>\r\n<p>*En el mismo d&iacute;a se concluye el tr&aacute;mite.</p>', '', 0, '', 'El mismo día que lo solicita ', '24 horas', NULL, NULL, '$676.00 vehículo de uso particular.\r\n$591.00 vehículo de trasporte público, modalidad de taxi.', 'Permanente.', 'Dependiendo de la institución donde vaya a realizar el trámite.', 'ciudadano/empresa', 'Reglamento de Seguridad Pública, Tránsito y Vialidad  municipal, vigente en el municipio de Uruapan, Michoacán y Ley que emite la Tesorería  municipal.', '6AdQFq67uf_6GSJ4prQEipLhU-LLt-yb.pdf', '', 'Cuando un vehículo que se remite al depósito  vehicular es del servicio público (taxi), el costo es de $591.00 pesos y el servicio son las 24 horas del día.\r\nLa Dirección de Tránsito y Vialidad municipal, no cuenta con depósito vehícular propio, por lo que el pago por resguardo y depósito se realiza con el concesionario donde se remite el vehículo.\r\n ', 2, '2019-11-12', '2019-11-12 18:00:29', 6, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (134, 7, 18, 'Constancia de NO INFRACCIÓN municipal ', 'Homo Clave', '<p>Se otorga una constancia donde se especif&iacute;ca&nbsp; que NO adeuda el pago de la infracci&oacute;n de tr&aacute;nsito, de licencias de manejo, tarjetas de circulaci&oacute;n, placas o veh&iacute;culos.</p>', '<p>* Asistir a la Direcci&oacute;n de Tr&aacute;nsito y Vialidad en el &aacute;rea de infracciones, con la documentaci&oacute;n necesaria para la realizaci&oacute;n del tr&aacute;mite.</p>\r\n<p>*En el mismo d&iacute;a se concluye el tr&aacute;mite.</p>', '', 0, '', '2 horas ', '24 horas ', NULL, 84, '', 'Permanente', 'Dependiendo de la institución  donde se vaya a realizar el trámite.', 'ciudadano/empresa', 'Reglamento de Seguridad Pública, Tránsito y Vialidad, vigente en el municipio de Uruapan, Michoacán y Ley de Ingresos que emite la Tesorería Municipal.', 'w_PBMzqetcshvFL2wesYjGOQtLAfksRV.pdf', '', '*Para la constancia de la licencia de manejo se necesita saber si es de chofer, automovilista, motociclista, del servicio público, estatal o federal.\r\n*Para la tarjeta de circulación, número de placas, nombre del propietario y estado donde se otorgaron.\r\n*Para placas, saber si es delantera o trasera y el nombre del propietario.', 2, '2019-11-12', '2019-11-12 20:00:18', 6, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (135, 7, 18, 'Pago de Boletas por multas de tránsito. ', 'Homo Clave', '<p>Es la cantidad a pagar por el concepto de la infraccci&oacute;n de tr&aacute;nsito que se cometi&oacute;, por infrirgir&nbsp; el Reglamento de Tr&aacute;nsito y Vialidad.</p>', '<p>*Asistir a las oficinas de la Secretar&iacute;a de Seguridad P&uacute;blica con la documentaci&oacute;n necesaria en horarios de atenci&oacute;n.</p>\r\n<p>*En el mismo d&iacute;a se concluye el tr&aacute;mite.</p>', '<p>Pagar la multa infringida.</p>', 0, '', '2 horas', '24 horas', NULL, NULL, 'Depende de la sanción que indique el tabulador en el Reglamento de Seguridad Pública, Tránsito y Vialidad municipal.', 'Permanente', 'Dependiendo de la Institución  donde vaya a realizar el trámite.', 'ciudadano/empresa', 'Reglamento de Seguridad Pública, Tránsito y Vialidad Municipal, vigente en el municipio de Uruapan, Michoacán y Ley de ingresos que emite la Tesorería municipal.', 'xD1MyBBv_gz1F-bzsrp3nW38wcGasYNI.pdf', '', 'Las cantidades a pagar,  se califican en base al tabulador del Reglamento de Seguridad Pública, Tránsito y Vialidad municipal, vigente en el municipio de Uruapan, Michoacán.', 2, '2019-11-13', '2019-11-13 20:00:51', 6, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (136, 11, 27, 'Licencia de construcción ', 'Homo Clave', '<p>Documento expedido por el Ayuntamiento a trav&eacute;s de la Secretaria de Desarrollo Urbano, mediante el cual se autoriza a los propietarios o poseedores de un bien inmueble para llevar a cabo acciones de construcci&oacute;n en nuestro Municipio</p>', '<p>1.- Revisi&oacute;n de expediente.</p>\r\n<p>2.- Asignaci&oacute;n de n&uacute;mero de expediente.</p>\r\n<p>3.- Verificaci&oacute;n de campo.</p>\r\n<p>4.-Verificaci&oacute;n de gabinete.</p>\r\n<p>5.- Asignaci&oacute;n de folio.</p>\r\n<p>6.- Elaboraci&oacute;n de documento definitivo o en su caso de requerimiento documental.</p>\r\n<p>7.- Sellado de planos.</p>\r\n<p>8.- Firma del Secretario de Desarrollo Urbano.</p>\r\n<p>9.- Ventanilla.</p>\r\n<p>10.- Pago de derechos.</p>\r\n<p>11.- Notificaci&oacute;n.</p>\r\n<p>12.- Captura.</p>\r\n<p>13.- Fin del tr&aacute;mite.</p>', '<p>Debe de cumplir con los requisicitos establecidos para dicha licencia.</p>', 1, 'jaPeUFUeRnefgkojAYgAeIXQjcgen43l.pdf', '48 horas ', '10 días', NULL, NULL, 'I. Por licencias o registros de construcción de obra nueva y/o ampliación por metro cuadrado de área en todos los niveles:\r\nA) Habitacional unifamiliar, atendiendo en primera instancia, a los metros cuadrados construidos y en segundo lugar, el tipo de fraccionamiento o zona, según lo determine la correspondiente autorización definitiva, o en su caso, el Programa de Desarrollo Urbano del Centro de Población vigente:\r\n1. Interés social o Popular:\r\na) Hasta un máximo de 60 m2. $ 7.10\r\nb) De 61 m2 y hasta 90 m2. $ 13.04 \r\nc) De 91 m2 a 120 m2. $ 15.41\r\n2. Media:\r\na) Hasta un máximo de 150 m2. $ 26.09\r\nb) De 151 m2 hasta 180 m2. $ 30.84\r\n3. Residencial:\r\na) Hasta un máximo de 210 m2. $ 37.94\r\nb) Excediendo de 210 m2. $ 43.87\r\nB) Muros, atendiendo a la altura, por metro lineal independientemente de la zona en que se ubique:\r\n1. Hasta un máximo de 2.50m. $ 8.28\r\n2. De 2.51m hasta de 3.50m. $ 13.04\r\n3. De 3.51m hasta 4.50m. $ 15.41\r\n4. Excediendo de 4.50m. $ 18.96\r\nC) Hoteles, moteles, posadas y similares: $ 26.09\r\nD) Comercial:\r\n1. Mercados. $ 7.10\r\n2. Locales comerciales hasta 100 m2. $ 17.78\r\n3. Locales comerciales mayores a 100 m2 del área total a construir, tiendas de autoservicio, centros comerciales y similares. $ 27.27\r\nE) Industrial, atendiendo a la magnitud según la clasificación de la Secretaría de Economía:\r\n1. Agroindustrial:\r\na) Mediana y grande. $ 2.36\r\nb) Pequeña. $ 3.54\r\nc) Micro. $ 4.73\r\n2. Otros:\r\na) Mediana y grande. $ 4.73\r\nb) Pequeña. $ 5.91\r\nc) Micro. $ 5.91\r\n3. Administración:\r\na) Oficinas en general. $ 25.28\r\nF) Educación, atendiendo al tipo de fraccionamiento o zona en la que se ubique:\r\n1. Popular. $ 5.91\r\n2. Medio. $ 9.47\r\n3. Residencial. $ 13.04\r\n4. Comercial. $ 16.59\r\nG) Hospitales y clínicas, atendiendo al tipo de fraccionamiento o zona en la que se ubique:\r\n1. Popular. $ 10.67\r\n2. Medio. $ 17.78\r\n3. Residencial. $ 23.72\r\n4. Comercial. $ 26.091. \r\nCentros de diversiones: bar, discotecas, centros nocturnos, centros botaneros, peñas, billares, palenques y/o similares. $ 32.02\r\n2. Centros deportivos, gimnasios y similares. $ 7.10\r\nI) Asistencia social y beneficencia pública, sin fines de lucro:\r\n1. Centros sociales comunitarios. $ 2.36\r\n2. Centros de meditación y religiosos. $ 3.54\r\n3. Cooperativas comunitarias. $ 8.28\r\n4. Centros de preparación dogmática. $ 17.78\r\nII. Licencias o registros de construcción para otros no especificados, sobre la base del presupuesto de la obra a valor comercial, presentado por el interesado, avalado por director responsable de obra actualizado.\r\nA) Hasta $ 3,000.00. $ 412.00\r\nB) De $ 3,001.00 en adelante la cuota del inciso anterior más el 1% del excedente.\r\n\r\nIII. Licencias o registros de demolición de fincas de cualquier tipo, por metro cuadrado del área total cubierta:\r\nA) Hasta un máximo de 60 m2. $ 4.73\r\nB) Más de 60 m2 y hasta 120 m2. $ 13.04\r\nC) Excediendo de 120 m2. $ 17.78\r\nV. Licencia para la construcción en la colocación de anuncios publicitarios y/o introducción de infraestructura de cualquier tipo en vía pública, independientemente de los derechos anuales por ocupación de la vía pública:\r\nA) Hasta $ 3,000.00 $ 317.00\r\nB) De $ 3,001.00 en adelante la cuota del inciso anterior más el 5% del excedente. Sobre la base del presupuesto a valor comercial, que para el efecto presente el interesado, firmado por el Director responsable de Obra actualizado.\r\nVII. Licencia de ejecución de obras de urbanización en fraccionamientos, conjuntos habitacionales y condominios, atendiendo a su tipo,\r\nconforme lo clasifique el Código de Desarrollo Urbano del Estado de Michoacán de Ocampo vigente, y sobre la base de la superficie total del predio, por metro cuadrado:\r\nA) Interés social o Popular. $ 1.09\r\nB) Medio. $ 1.54\r\nC) Residencial. $ 1.96\r\nD) Campestres. $ 1.09\r\nE) Industrial. $ 2.67\r\nF) Rústico tipo granja. $ 0.68\r\nG) Comercial. $ 1.96\r\nH) Cementerios. $ 1.09\r\nXIII. Licencias de construcción para obras habitacionales unifamiliares, las constancias emitidas y cualquier tipo de trámite realizado por  la Dirección de Desarrollo Urbano con carácter de:\r\nA) Urgente (72 horas en días hábiles), se pagará dos veces la tarifa que en su caso corresponda, conforme a lo especificado en las fracciones anteriores de este artículo; y, \r\nB) Con carácter de extra urgente (48 horas en días hábiles), se pagará tres veces la tarifa que en su caso corresponda, conforme a lo especificado en las fracciones anteriores de este artículo.\r\n', 'Indefinido', 'Indefinido', 'ciudadano/empresa', 'Artículos 1, 5 fracción XX, 8 fracción II, 19, 34, 109 al 118, y demás relativos del Reglamento de Construcciones para el Municipio de Uruapan, Michoacán.', 'Zsd3kPegl4jqBOWpyddbEYtfVSLLAaJN.pdf', '', 'Llenar adecuadamente con letras minúsculas excepto las primeras de cada renglón o primeras de nombres propios, checar la ortografía y redacción, la fuente sería calibri tamaño 11 sin negritas.', 2, '2019-11-28', '2019-11-28 17:00:50', 3, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (137, 17, NULL, 'Taller de manualidades  ', 'Homo Clave', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Otorgar a la poblaci&oacute;n talleres de manualidades con la finalidad de orientarles un oficio y/o una herramienta para que logren integrarse en el &aacute;mbito laboral adem&aacute;s de ayudar en la recreaci&oacute;n de las personas.</span></p>', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">1.- Requisitar solicitud 2.- Entrega de documentaci&oacute;n 3.- Pagar Inscripci&oacute;n&nbsp; en el centro comunitario correspondiente&nbsp;&nbsp;</span></p>', '', 0, '', 'Inmediato ', '2 horas', NULL, 150, '', 'anual', 'permanente', 'ciudadano', 'Reglas de operación  del programa de HABITAT', 'qVX7PKzFBimi3rsMrSvbncyv-4R-c6LC.pdf', '', 'NINGUNA', 2, '2019-12-04', '2019-12-04 20:00:46', 7, NULL, NULL, NULL, 1);
