INSERT INTO `tramites` VALUES (139, 17, NULL, 'Curso de cultora de belleza', 'Homo Clave', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Este curso tiene como objetivo proporcionar elementos de capacitaci&oacute;n que le permitan desarrollarse en cortes de cabello, maquillaje, colorimetr&iacute;a, dermatolog&iacute;a, manicure, pedicura, entre otros.</span></p>', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">1.- Requisitar solicitud 2.- Entrega de documentaci&oacute;n 3.- Pagar Inscripci&oacute;n&nbsp; en el centro comunitario correspondiente&nbsp;&nbsp;</span></p>', '', 0, '', 'Inmediato', '2 horas', NULL, NULL, '150', 'anual', 'permanente', 'ciudadano', 'Reglas de operación  programa de infraestructura', 'sXtPv-ITJ5OAqVNDR7ZMllWIdYe-m4W-.pdf', '', '', 2, '2019-12-04', '2019-12-04 21:00:26', 7, NULL, NULL, NULL, 1);
