INSERT INTO `tramites` VALUES (141, 17, NULL, 'Taller de Taller de aerobics', 'Homo Clave', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Tiene como objetivo brindar a la poblaci&oacute;n en general una actividad deportiva que contribuya a mejorar su salud</span></p>', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">1.- Requisitar solicitud 2.- Entrega de documentaci&oacute;n 3.- Pagar Inscripci&oacute;n&nbsp; en el centro comunitario correspondiente&nbsp;&nbsp;</span></p>', '', 0, '', 'INMEDIATO', '2 HORAS', NULL, 150, '', 'ANUAL', 'PERMANENTE', 'ciudadano', 'Reglas de operación  programa de infraestructura', 'm2AwKWMZabrcs52cjYsNcQPDDLzOmZKO.pdf', '', '', 2, '2019-12-04', '2019-12-04 21:00:47', 7, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (142, 17, NULL, 'Taller de pintura y dibujo', 'Homo Clave', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">El taller va dirigido a ni&ntilde;o y adolescentes, el objetivo es brindar a los participantes&nbsp; conocimientos sobre el arte y la cultura a trav&eacute;s de la pintura</span></p>', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">1.- Requisitar solicitud 2.- Entrega de documentaci&oacute;n 3.- Pagar Inscripci&oacute;n&nbsp; en el centro comunitario correspondiente&nbsp;&nbsp;</span></p>', '', 0, '', 'Inmediata', '2 horas', NULL, 150, '', 'anual', 'permanente', 'ciudadano', 'Reglas de operación  programa de infraestructura', 'DZOBr9W86RfK2LxPS--cOUev8U_m18ee.pdf', '', '', 2, '2019-12-04', '2019-12-04 22:00:57', 7, NULL, NULL, NULL, 1);
