INSERT INTO `tramites` VALUES (152, 17, NULL, 'Academia DIF Municipal ', 'Homo Clave', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Se realiza la inscripci&oacute;n de los talleres de Academia DIF para los diferentes talleres, los cuales son: Belleza, Corte y Confecci&oacute;n, Manualidades, Cocina y Reposter&iacute;a, Ingles y Ballet.</span></p>', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">&nbsp;1.Asistir al &aacute;rea de Educaci&oacute;n DIF 2.Conocer requisitos 3. Entrega de requisitos 4. Leer y firmar Reglamento 5.-Entrega y Pago de Inscripci&oacute;n en Caja del DIF 6. Entrega de comprobante de pago</span></p>', '', 1, '-wGUdYkjz6Z4Ie3CcqSqL9gnKNJzb5lQ.pdf', '15 a 30 minutos', '2 horas', NULL, 130, '', 'Agosto a Diciembre del ciclo escolar. Inscripciones posteriores a éste período no obtiene Constancia al finalizar el ciclo escolar.', 'Indefinida. El documento emitido (Constancia o Diploma) tiene valor curricular  ', 'ciudadano', 'Ley de Asistencia Social; Art. 12., Inciso h).', 'y36NFAEdpnj5oGqZnKsJIRpGi3pzEal4.pdf', '', '', 2, '2019-12-06', '2019-12-06 16:00:31', 7, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (153, 17, NULL, 'CECADES (Centro de Capacitación y Desarrollo)', 'Homo Clave', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Se realiza la inscripci&oacute;n de los talleres de&nbsp; DIF para los diferentes talleres, los cuales son: Belleza, Corte y Confecci&oacute;n, Manualidades y&nbsp; Cocina y Reposter&iacute;a.</span></p>', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">1.Asistir al Centro de Capacitaci&oacute;n y Desarrollo de su preferencia (CECADES DIF) 2.Conocer requisitos 3. Entrega de requisitos 4. Leer y firmar Reglamento 5.-Entrega y Pago de Inscripci&oacute;n con la Maestra responsable del curso.</span></p>', '', 1, 'yfTp1SxarxSdNNgRoLbcfk1DUAUE-O0M.pdf', '15 a 30 minutos ', '2 horas', NULL, 130, '', 'Agosto a Diciembre del ciclo escolar. Inscripciones posteriores a éste período no obtiene Constancia al finalizar el ciclo escolar.', 'Indefinida. El documento emitido (Constancia o Diploma) tiene valor curricular  ', 'ciudadano', 'Ley de Asistencia Social; Art. 12., Inciso h).', '9fqIUbEvDa5fG4P1P096reEs6Ng__A4G.pdf', '', '', 2, '2019-12-06', '2019-12-06 17:00:51', 7, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (154, 17, NULL, 'CAICS (Centros de Asistencia Infantil Comunitarios)', 'Homo Clave', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Se realiza la Inscripci&oacute;n, para los CAICS (Centros de Atenci&oacute;n Infantil Comunitarios), que se encuentran en la Periferia de la ciudad de Uruapan y en la comunidad de Cutzato. Son espacios de educaci&oacute;n b&aacute;sica (Nivel Preescolar)</span></p>', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">1. Asistir al CAIC o preescolar de su elecci&oacute;n 2.Conocer requisitos 3. Entrega de requisitos 4. Leer y firmar Reglamento 5.-Entrega y Pago de Inscripci&oacute;n con Maestra responsable de grupo. 6. Entrega de comprobante de pago</span></p>', '', 1, 'onc2syBg54FIdudtBKZOuqko9Jo_DBbN.pdf', '15 a 30 minutos ', '2 horas', NULL, 130, '', 'Ciclo escolar vigente', 'Cartilla de Evaluación', 'ciudadano', 'Ley de Asistencia Social; Art. 12., Inciso h).', 'L9wupBAHaoYjZxk7DDlBqMKp6TC02QVW.pdf', '', '', 2, '2019-12-06', '2019-12-06 17:00:10', 7, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (155, 17, NULL, 'Estancia Infantil  ', 'Homo Clave', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">La estancia cuenta con guarder&iacute;a (maternal) y preescolar; se reciben ni&ntilde;os a partir de un a&ntilde;o y hasta los 5 a&ntilde;os, con horario de 7:30 a 15:30 hrs. este servicio es abierto para la madres solteras que se encuentran trabajando. Para el costo de inscripciones y de mensualidades del siguiente ciclo escolar, pueden presentar actualizaciones en el mes de febrero, esto en funci&oacute;n de la inflaci&oacute;n proyectada anual; as&iacute; mismo, en caso de solicitantes del servicio&nbsp; que no cubran con el perfil, aplicar&aacute;n otros costos semejantes al ofertado en&nbsp; instituciones de mercado abierto.</span><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">&nbsp;</span></p>', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">1.- Pedir informes de los requisitos. 2.- Recabar la documentaci&oacute;n. 3.- Entregar la documentaci&oacute;n completa en la Estancia. 4.- Realizaci&oacute;n de estudio socio-econ&oacute;mico y visita domiciliaria. 5.- Si es candidato se llama para ser recibido y se realiza el pago de inscripci&oacute;n y la mensualidad correspondiente.</span></p>', '', 0, '', 'Variable', 'Variable', NULL, NULL, 'Madre o padre soltero $380.00 (trescientos ochenta  pesos 00/100 M.N.).\r\nPadres de familia casados $850.00 (ochocientos cincuenta 00/100 M.N.).\r\n', 'Ciclo escolar vigente', 'Cartilla de Evaluación', 'ciudadano', 'Ley de Asistencia Social. Art. 12 ', 'TpZWoz6NIO4VYxYQ4t2_6SNCn1QekRPO.pdf', '', '', 2, '2019-12-06', '2019-12-06 17:00:31', 7, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (156, 17, NULL, 'Apoyos en Programa Espacios de Alimentación Encuentro y Desarrollo (EDAEyD)', 'Homo Clave', '<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin; mso-ansi-language: ES-MX; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Coadyuvar a la seguridad alimentaria de la poblaci&oacute;n vulnerable a trav&eacute;s de la habilitaci&oacute;n de espacios para la elaboraci&oacute;n comunal de alimentos elaborados higi&eacute;nicamente, de costos accesibles y que constituyan una alternativa de atenci&oacute;n, participaci&oacute;n y organizaci&oacute;n social</span></p>', '<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: left;\" align=\"center\">El solicitante entregar&aacute; la documentaci&oacute;n requerida en DIF Uruapan.</p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Posteriormente el &Aacute;rea correspondiente se encargar&aacute; de darle el tr&aacute;mite y notificarle la respuesta al solicitante.&nbsp;</span></p>', '', 0, '', 'El SMDIF, notificará a los solicitantes el resultado de su trámite ya sea positivo o negativo, expresando en este último caso, los motivos por los cuales no fue aprobada su solicitud. ', 'variable', NULL, NULL, '', '3 meses', 'permanente', 'ciudadano', 'Ley de Asistencia Social del Estado de Michoacán de Ocampo, en su artículo 6º, fracción VIII,VIII, IX y X. \r\n', 'hy9vo2TyHu8RPsNbouNvp7Dg9aOyeADZ.pdf', '', '', 2, '2019-12-06', '2019-12-06 18:00:25', 7, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (157, 17, NULL, 'Subprograma Comunidad DIFerente', 'Homo Clave', '<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin; mso-ansi-language: ES-MX; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Contribuir a que las personas integren Poblaciones Articuladas para mejorar sus Condiciones Sociales de Vida.</span></p>', '<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: center; line-height: normal;\" align=\"center\">El solicitante entregar&aacute; la solicitud por escrito en DIF Uruapan.</p>\r\n<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Posteriormente el &Aacute;rea correspondiente se encargar&aacute; de darle el tr&aacute;mite y notificarle la respuesta al solicitante.</span></p>', '', 0, '', 'Las instancias ejecutoras del SCD son los SEDIF, notificará a los solicitantes el resultado de su trámite ya sea positivo o negativo, expresando en este último caso, los motivos por los cuales no fue aprobada su solicitud.', 'variable', NULL, NULL, '', '3 meses', '1 año', 'ciudadano', 'Los gastos indirectos del Programa de Desarrollo Comunitario \"Comunidad DIFerente\", para el ejercicio fiscal 2018, se ajustarán a lo establecido en el Decreto que establece las medidas para el uso eficiente, transparente y eficaz de los recursos públicos, y las acciones de disciplina presupuestaria en el ejercicio del gasto público, así como para la modernización de la Administración Pública Federal, publicado en el Diario Oficial de la Federación el 10 de diciembre de 2012; su modificación, publicada el 30 de diciembre de 2013; los Lineamientos para la aplicación y seguimiento de las medidas para el uso eficiente, transparente y eficaz de los recursos públicos, y las acciones de disciplina presupuestaria en el ejercicio del gasto público, así como para la modernización de la Administración Pública Federal, publicados el 30 de enero de 2013 y los Lineamientos por los que se establecen medidas de austeridad en el gasto de operación en las dependencias y entidades de la Administración Pública Federal, publicados el 22 de febrero de 2016, he tenido a bien expedir el siguiente: Recursos: apoyo federal (Ramo 12) ', '', '', '', 2, '2019-12-06', '2019-12-06 18:00:36', 7, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (158, 17, NULL, 'Programa Proyectos Productivos', 'Homo Clave', '<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin; mso-ansi-language: ES-MX; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">El Programa tiene la finalidad de dar atenci&oacute;n a la poblaci&oacute;n que vive en condiciones de pobreza, focalizada en municipios de muy alta y alta marginaci&oacute;n, con el prop&oacute;sito de potenciar el desarrollo de sus capacidades, habilidades y destrezas; incorporando en ellos el desarrollo de capacidades humanas y t&eacute;cnicas como elementos que propicien la sostenibilidad y sustentabilidad econ&oacute;mica y ambiental.</span></p>', '<h5 class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: left;\" align=\"center\">El solicitante entregar&aacute; la solicitud por escrito en DIF Uruapan.</h5>\r\n<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Posteriormente el &Aacute;rea correspondiente se encargar&aacute; de darle el tr&aacute;mite y notificarle la respuesta al solicitante.</span></p>', '', 0, '', 'Corresponderá al Sistema DIF Michoacán la evaluación de solicitudes con base a los criterios de elegibilidad establecidos en las Reglas de Operación, aquellas solicitudes que cumplan con los requisitos serán incluidas   dentro de las propuestas de inversi', 'variable', NULL, NULL, '', '3 meses', '1 año', 'ciudadano', 'Reglas de Operación de  Periódico Oficial de la Federación 27 de Abril del 2011 2ª Secc.\r\nLey de Asistencia Social del Estado de Michoacán de Ocampo, en su artículo 9° fracción II\r\n', '', '', '', 2, '2019-12-06', '2019-12-06 18:00:18', 7, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (159, 17, NULL, 'Participación en el Programa de pañales Pacientes Discapacitados, Adultos Mayores y Madres Solteras', 'Homo Clave', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">&nbsp;Apoyar a personas en situaci&oacute;n vulnerable con alguna discapacidad f&iacute;sica, adultos mayores y/o con enfermedades cr&oacute;nico degenerativas y madres solteras.</span></p>', '<ol style=\"margin-top: 0cm;\" start=\"1\" type=\"1\">\r\n<li class=\"MsoNormalCxSpFirst\" style=\"margin-bottom: 0.0001pt; line-height: normal;\">Presentar documentaci&oacute;n del paciente</li>\r\n<li class=\"MsoNormalCxSpMiddle\" style=\"margin-bottom: 0.0001pt; line-height: normal;\">Realizar estudio socioecon&oacute;mico</li>\r\n<li class=\"MsoNormalCxSpMiddle\" style=\"margin-bottom: 0.0001pt; line-height: normal;\">Realizar visita domiciliaria</li>\r\n<li class=\"MsoNormalCxSpMiddle\" style=\"margin-bottom: 0.0001pt; line-height: normal;\">Valorar situaci&oacute;n</li>\r\n</ol>\r\n<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Enlistar en el padr&oacute;n de beneficiarios</span></p>', '', 0, '', '3 Días', '10 Días', NULL, NULL, '', 'Permanente', 'El vale de apoyo se hará efectivo en el mismo día de entrega', 'ciudadano', 'Ley de Asistencia Social en el Estado de Michoacán ', 'gzasXbdaT_Mh2DJLCGve3PAWiaKBqiHm.pdf', '', '', 2, '2019-12-06', '2019-12-06 18:00:44', 7, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (160, 17, NULL, 'Programa de Pasaje', 'Homo Clave', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Apoyar a personas en situaci&oacute;n vulnerable con alguna discapacidad f&iacute;sica, adultos mayores y/o con enfermedades cr&oacute;nico degenerativas y/o madres solteras que requieran viajar por cuestiones de salud.</span></p>', '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]-->1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Presentar documentaci&oacute;n del paciente en la instituci&oacute;n o v&iacute;a correo electr&oacute;nico.</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]-->2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Realizar visita domiciliaria y estudio socioecon&oacute;mico.</p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]-->3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Valorar situaci&oacute;n.</p>\r\n<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Enlistar en el padr&oacute;n de beneficiarios.</span></p>', '', 0, '', '3  días', '10 días', NULL, NULL, '', 'Durante todo el año', 'El vale de apoyo se hará efectivo en el mismo día de entrega', 'ciudadano', 'Ley de Asistencia Social en el Estado de Michoacán ', 'm3C1Aje9ZAWNNVUGKiZPpXPxk4KIAnkR.pdf', '', '', 2, '2019-12-06', '2019-12-06 19:00:36', 7, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (161, 17, NULL, ' Programa de Contingencias y siniestros ', 'Homo Clave', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Brindar atenci&oacute;n a las familias que por siniestros de incendio y/o Inundaciones requieren ser asistidos&nbsp;&nbsp;</span></p>', '<ol style=\"margin-top: 0cm;\" start=\"1\" type=\"1\">\r\n<li class=\"MsoNormalCxSpFirst\" style=\"margin-bottom: 0.0001pt; line-height: normal;\">Realizar estudio socioecon&oacute;mico</li>\r\n<li class=\"MsoNormalCxSpMiddle\" style=\"margin-bottom: 0.0001pt; line-height: normal;\">Realizar visita domiciliaria</li>\r\n<li class=\"MsoNormalCxSpMiddle\" style=\"margin-bottom: 0.0001pt; line-height: normal;\">Valorar situaci&oacute;n</li>\r\n</ol>\r\n<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Otorgar apoyo correspondiente</span></p>', '', 0, '', 'Inmediato', '3 días', NULL, NULL, '', 'Todo el año', 'El vale de apoyo se hará efectivo en el mismo día de entrega', 'ciudadano', 'Ley de Asistencia Social en el Estado de Michoacán', 'Hpk0K9CkcffbfNKtyTeGJ9B15JZkmTS5.pdf', '', '', 2, '2019-12-06', '2019-12-06 19:00:56', 7, NULL, NULL, NULL, 1);
