INSERT INTO `tramites` VALUES (167, 17, NULL, 'Consulta Especialista en Rehabilitación', 'Homo Clave', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Hacer una evaluaci&oacute;n global de salud f&iacute;sica y mental del paciente con el prop&oacute;sito de ayudar a mejorar el nivel de vida con una terapia adecuada</span></p>', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">1. Entregar&nbsp; Hoja de canalizaci&oacute;n&nbsp; de m&eacute;dico que env&iacute;a 2.- Entregar estudios de gabinete&nbsp; 3.-&nbsp; Valoraci&oacute;n m&eacute;dica&nbsp; 4.- Elaboraci&oacute;n de estudio socioecon&oacute;mico y&nbsp; entregar tarjeta de citas con calendario de terapias 5.- Pagar en caja Dif municipal&nbsp; &nbsp;</span></p>', '', 0, '', 'inmediato', '1 hora', NULL, 150, '', 'Permanente', 'Permanente', 'ciudadano', 'Ley  para la inclusión de las personas con discapacidad ', '6U82dZliNLV15L7rEx57B0px9taCqndp.pdf', '', '', 2, '2019-12-06', '2019-12-06 21:00:51', 7, NULL, NULL, NULL, 1);
