INSERT INTO `tramites` VALUES (187, 17, NULL, 'EMPACADORES EN PLENITUD', 'Homo Clave', '<p><span lang=\"ES\" style=\"font-size: 10.0pt; line-height: 107%; font-family: \'Verdana\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: ES; mso-fareast-language: ES; mso-bidi-language: AR-SA;\">Que&nbsp; las personas Adultas Mayores perciban un ingreso diario voluntario de las tiendas&nbsp;&nbsp; SORIANA,&nbsp;&nbsp;&nbsp; COMERCIAL MEXICANA , WALDDOS y WALMART ya que se hacen los convenios con&nbsp; las empresas particulares diversas en el&nbsp; DIF Municipal.</span></p>', '<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: center; line-height: normal;\" align=\"center\">1. Acuden a los Centros comerciales</p>\r\n<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">2. Se les piden los requisitos</span></p>', '', 0, '', 'Inmediata', '2 horas', NULL, NULL, '', 'anual', 'anual', 'ciudadano', 'LEY DE ASISTENCIA SOCIAL', 'miZ4czH-ML8SRXj-8jLtRUHVFoBkdDqQ.pdf', '', '', 2, '2019-12-09', '2019-12-09 20:00:54', 7, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (188, 17, NULL, 'Despensa familiar (AAFD)para adulto mayor', 'Homo Clave', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Se otorga la despensa AAFD (Asistencia Alimentaria a Familias en Desamparo) a los adultos mayores a partir de los 60 a&ntilde;os, se entrega cada mes en las instalaciones del DIF, solamente tienen que presentar la tarjeta que se les otorg&oacute; al inscribirse en este programa. Tiene una cuota de recuperaci&oacute;n de $30.</span></p>', '<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\">1.-Acudir al &aacute;rea de adulto mayor.<span style=\"mso-spacerun: yes;\">&nbsp;&nbsp; </span>2.-Entregar los documentos que se requieren.<span style=\"mso-spacerun: yes;\">&nbsp;&nbsp; </span>3.- Hacer el estudio socioecon&oacute;mico.<span style=\"mso-spacerun: yes;\">&nbsp; </span>4.- Entregar la tarjeta del programa para que pueda recoger cada vez que llegue la dotaci&oacute;n.<span style=\"mso-spacerun: yes;\">&nbsp; </span>5.- Para llevarse su despensa pasa al &aacute;rea de adulto mayor, se le hace un recibo, firma, se sella, firma el que elabor&oacute; el recibo.<span style=\"mso-spacerun: yes;\">&nbsp; </span>6.- Firmar un padr&oacute;n.<span style=\"mso-spacerun: yes;\">&nbsp; </span>7.-Pagar en caja.<span style=\"mso-spacerun: yes;\">&nbsp;&nbsp; </span>8.- Recoger en la bodega la despensa.</span></p>', '', 1, 'JkV6BLDgdcMvbCGig_lp4Tk1n6uQZW27.pdf', 'Inmediata', '2 horas', NULL, 30, '', 'anual', 'anual', 'ciudadano', 'Ley de Asistencia Social. Art. 12 ', 'FDYRY6dnMG1Lk_NFFGO0jNqAuqT4FSdv.pdf', '', '', 2, '2019-12-09', '2019-12-09 20:00:55', 7, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (189, 17, NULL, 'Despensa familiar (AAFD)para adulto mayor', 'Homo Clave', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Se otorga la despensa AAFD (Asistencia Alimentaria a Familias en Desamparo) a los adultos mayores a partir de los 60 a&ntilde;os, se entrega cada mes en las instalaciones del DIF, solamente tienen que presentar la tarjeta que se les otorg&oacute; al inscribirse en este programa. Tiene una cuota de recuperaci&oacute;n de $30.</span></p>', '<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: black; mso-fareast-language: ES-MX;\">1.-Acudir al &aacute;rea de adulto mayor.<span style=\"mso-spacerun: yes;\">&nbsp;&nbsp; </span>2.-Entregar los documentos que se requieren.<span style=\"mso-spacerun: yes;\">&nbsp;&nbsp; </span>3.- Hacer el estudio socioecon&oacute;mico.<span style=\"mso-spacerun: yes;\">&nbsp; </span>4.- Entregar la tarjeta del programa para que pueda recoger cada vez que llegue la dotaci&oacute;n.<span style=\"mso-spacerun: yes;\">&nbsp; </span>5.- Para llevarse su despensa pasa al &aacute;rea de adulto mayor, se le hace un recibo, firma, se sella, firma el que elabor&oacute; el recibo.<span style=\"mso-spacerun: yes;\">&nbsp; </span>6.- Firmar un padr&oacute;n.<span style=\"mso-spacerun: yes;\">&nbsp; </span>7.-Pagar en caja.<span style=\"mso-spacerun: yes;\">&nbsp;&nbsp; </span>8.- Recoger en la bodega la despensa.</span></p>', '', 1, 'hwiz9Rnh6DKVYDgZIgBIphGoamy7Nkr5.pdf', 'Inmediata', '2 horas', NULL, 30, '', 'anual', 'anual', 'ciudadano', 'Ley de Asistencia Social. Art. 12 ', '9icYRWYoZgUONRHHTIEtrr6mmzl05pgu.pdf', '', '', 2, '2019-12-09', '2019-12-09 21:00:56', 7, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (190, 17, NULL, ' Alerta Plateada', 'Homo Clave', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Se otorga una pulsera de silic&oacute;n a los adultos mayores y a toda persona hombres y mujeres que lo soliciten y padezcan una enfermedad cognitiva&nbsp; prioritariamente con alzheimer o discapacidad mental, se otorga personalmente en las instalaciones del DIF.</span></p>', '<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">1.-&nbsp; Solicitar entrar al programa para recibir la pulsera.&nbsp; 2.- Presentar los documentos que se requieran.&nbsp; 3.-Hacer la encuesta, anotando datos personales, familiares y rasgos f&iacute;sicos muy detallados. 4.- Tomar una foto&nbsp; 5.-Subir la encuesta y la foto al sistema.&nbsp; 6.- Entregar la pulsera de silic&oacute;n marcada con el folio correspondiente.&nbsp;</span></p>', '', 0, '', 'Inmediata', '2 horas', NULL, NULL, '', 'Indeterminado', 'Indeterminado', 'ciudadano', 'Ley de Asistencia Social. Art. 12 ', 'DZKVuM8Ij74o2gv2axQu7fvAMOk38Lq5.pdf', '', '', 2, '2019-12-09', '2019-12-09 21:00:09', 7, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (191, 17, NULL, 'Programa Asistencia Alimentaria a Familias en Desamparo (A.A.F.D.)', 'Homo Clave', '<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: ES-MX; mso-fareast-language: ES-MX; mso-bidi-language: AR-SA;\">Brindar atenci&oacute;n a individuos, grupos, familias y comunidades pertenecientes a nuestro Municipio, los cuales presenten un grado de marginaci&oacute;n, desamparo y pobreza, el cual no les permite cubrir sus necesidades b&aacute;sicas, la cual es una alimentaci&oacute;n sana y balanceada.</span></p>', '<div>\r\n<table cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td style=\"padding: 0cm 7.05pt 0cm 7.05pt;\" align=\"left\" valign=\"top\">\r\n<ol style=\"margin-top: 0cm;\" start=\"1\" type=\"1\">\r\n<li class=\"MsoNormalCxSpFirst\" style=\"margin-bottom: 0.0001pt; text-align: center; line-height: normal;\">Acudir al &aacute;rea de alimentaci&oacute;n con la documentaci&oacute;n requerida.</li>\r\n<li class=\"MsoNormalCxSpMiddle\" style=\"margin-bottom: 0.0001pt; text-align: center; line-height: normal;\">Elaboraci&oacute;n del estudio socioecon&oacute;mico y valoraci&oacute;n del mismo.</li>\r\n<li class=\"MsoNormalCxSpMiddle\" style=\"margin-bottom: 0.0001pt; text-align: center; line-height: normal;\">Entrega de tarjeta del programa.</li>\r\n</ol>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Entrega de dotaciones cada mes y medio.&nbsp;</span></p>', '', 1, '2g1f5GOAssR7Wpd4sXbcUyM3Rim3TYdz.pdf', 'Inmediata', '2 horas', NULL, 30, '', 'Un año', 'Un año', 'ciudadano', 'Reglas de operación del programa de asistencia alimentaria en familias en desamparo (AAFD).', 'OD0lmqrDLTr_WVoE0JxBLKrylAVqjXnu.doc', '', '', 2, '2019-12-09', '2019-12-09 22:00:38', 7, NULL, NULL, NULL, 1);
INSERT INTO `tramites` VALUES (192, 17, NULL, 'Programa Desayunos Escolares Calientes (DEC)', 'Homo Clave', '<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: ES-MX; mso-fareast-language: ES-MX; mso-bidi-language: AR-SA;\">Fortalecer la dieta de los ni&ntilde;os y ni&ntilde;as en edad preescolar y primaria que habitan el Municipio con alta y muy alta marginaci&oacute;n, proporcion&aacute;ndoles un desayuno que consiste en una combinaci&oacute;n de alimentos que proporcionar&aacute; el 30% como m&iacute;nimo de la energ&iacute;a y&nbsp; prote&iacute;nas de acuerdo a la NOM 169-SSA-1998</span></p>', '<div>\r\n<table cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td style=\"padding: 0cm 7.05pt 0cm 7.05pt;\" align=\"left\" valign=\"top\">\r\n<ol style=\"margin-top: 0cm;\" start=\"1\" type=\"1\">\r\n<li class=\"MsoNormalCxSpFirst\" style=\"margin-bottom: 0.0001pt; text-align: center; line-height: normal;\">Acudir al &aacute;rea de alimentaci&oacute;n con la documentaci&oacute;n requerida.</li>\r\n<li class=\"MsoNormalCxSpMiddle\" style=\"margin-bottom: 0.0001pt; text-align: center; line-height: normal;\">Elaboraci&oacute;n del estudio socioecon&oacute;mico y valoraci&oacute;n del mismo.</li>\r\n<li class=\"MsoNormalCxSpMiddle\" style=\"margin-bottom: 0.0001pt; text-align: center; line-height: normal;\">Entrega de tarjeta del programa.</li>\r\n</ol>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p><span style=\"font-size: 11pt; line-height: 107%; font-family: Calibri, sans-serif;\">Entrega de dotaciones cada mes y medio</span></p>', '', 1, 'cMHNe4M7TkzjmzgfWQiF1VZ7AyR8tJXF.doc', 'Inmediata', '2 hroas', NULL, NULL, '$2.00 (Do pesos 00/100m.n), por día por niño', 'Un año', 'Un año', 'ciudadano', 'Reglas de operación del Programa de Desayunos Escolares Caliente (DEC).', 'UebXFYrZ5A7uP5XbcbfgxqfGdDRjhToc.doc', '', '', 2, '2019-12-09', '2019-12-09 22:00:24', 7, NULL, NULL, NULL, 1);
